d4dcf567-1b04-44b5-a0c7-fb6e2b020937	rec0nJRrsaXR5R3a9	Lia Lohmanns Interview aus dem Online Kongress "Der neue Mensch"	lia-lohmanns-interview-aus-dem-online-kongress-der-neue-mensch	Tauche ein in die Essenz des neuen Menschseins durch Lias tiefgründiges Gespräch mit Tobi aus dem Kongress "Der neue Mensch".\nIn diesem herzöffnenden Interview enthüllt Lia zeitlose Weisheiten und praktische Erkenntnisse zur Evolution des Bewusstseins. \nSpüre die transformative Energien, die durch jedes Wort fließt und dich sanft in höhere Frequenzen trägt.\nDie besprochenen Themen berühren die Tiefen deiner Seele und erinnern dich an dein wahres multidimensionales Potenzial. Lass dich von dieser kostbaren Aufzeichnung inspirieren und nähren.\nDieses Interview ist ein Geschenk für alle Seelen, die bereit sind, den Schritt in eine neue Ära des Menschseins zu wagen – authentisch, bewusst und in voller Verbindung mit dem kosmischen Herzen.\nÖffne dein Herz und empfange die Frequenzen des neuen Menschen – sie warten bereits in dir.\nMit Liebe \ndeine Lia \n\n	Test Beispiel Beischreibung	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/wuMRsL4F1reA4ZlZIRDVrQ/CsVbvEJi2rFFdBE6lcT-CgvkrNfd29-HVk3WZYkDbCwSe7JBhcAoEX-yWSYvFp7zfA6AHkYIoqbcYxGb7iOsvkndbPwR3Ls1WrZhYXjum89mUlHHwFNOQxhyVMpKW40LadTdx-G74Pg-nCW2GqtDm1hzRtG3lryoAvRGeFmr8r4/B-SImGeXRrWOGcuzM5vk7PMzqNOZYSmNbwIRweVEwR0	\N	1800	EUR	published	\N	Interview	\N	ozean_licht	\N	2025-11-28 14:22:39.282337+00	2025-11-28 14:25:55.166262+00	\N	{"original_fields": {"id": 1046, "created_at": "2025-05-21T08:56:42.000Z", "created_by": {"id": "usrRfU4OsN7q6fPUM", "name": "Sergej Götz", "email": "sergej@ozean-licht.com"}, "updated_at": "2025-10-27T17:58:18.000Z", "updated_by": {"id": "usrPAGESHARE00000", "name": "Anonymous", "email": "anonymous+formpage@noreply.airtable.com"}, "course_link": "https://portal.ozean-licht.com/s/ozean-licht/Lias-Interview-Kongress-Der-neue-Mensch-96e7e51d", "member_count": 122, "published_at": "2025-03-23", "course