2e5ce308-0a07-478d-b581-1b103be5ccf6	rec3CgLEqSWaIR1Ag	Gruppen channeling Event am 11.11.2025	gruppen-channeling-event-am-11-11-2025	Live Gruppen Channeling Event \nam 11.11.2025 um 20:30 Uhr Berlin Zeit \nDas 11-11-Portal gilt als kraftvoller Schlüssel für **Transformation, Booster-Energie und Rückkehr zu deinem wahren Selbst**.\nIn diesem Channeling erlebst du, wie sich dein **neues Selbst** formt und zur Wintersonnenwende „geboren“ werden kann. Ein tiefes Portal, das dich mit Fokus und Klarheit neu ausrichtet und rekalibriert.\n\nIch lade dich von Herzen ein, am 11.11.2025 um 20:30 Uhr (Berlin Zeit) dabei zu sein und mit uns gemeinsam dieses transformative Tor zu durchschreiten, das dich zu deiner wahren Essenz zurückführt.\nIch freue mich auf dich – von Herz zu Herz,\n\nDeine Lia \n\n	\N	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/cwLuVCNu2Hpg_32kc4ELxw/BKnsGZig3LXQLrmqG0PVmEa6ZV_qIXWKZyHlMoqmVsE-w5b_J13AlDlKlWtOE2WA1J1Uf2X9_kDbkQMdfYuEYEheJQvl-hyNXhWCJCVjcRZzO_9sScWytuWvs8g94E3mA50CsFbJamV04FdD7YarZV1aVHS7jOykCUePJrk9aezHuOyPpjLpgk1L4SthgyDt/X1JI7N38QDsOLWJBqv7s5GBJgF-J1Z15PgP7dnodGI4	\N	3900	EUR	published	\N	Basis	\N	ozean_licht	\N	2025-11-28 14:22:39.284128+00	2025-11-28 14:25:55.167674+00	\N	{"original_fields": {"id": 1081, "created_at": "2025-10-02T12:43:25.000Z", "created_by": {"id": "usrRfU4OsN7q6fPUM", "name": "Sergej Götz", "email": "sergej@ozean-licht.com"}, "updated_at": "2025-10-16T10:44:24.000Z", "updated_by": {"id": "usrBbbCeepxR7ywxr", "name": "Miriam Rinderle", "email": "miriam@ozean-licht.com"}, "course_link": "https://portal.ozean-licht.com/s/ozean-licht/gruppen-channeling-event-11-11-2025-da9968e6", "member_count": 26, "published_at": "2025-11-11", "course_id_seq": 81, "linked_orders": ["recSGnvBNzNIA2TcL", "rec4c70fSaFQteNaK", "recd02eUnHyH5nCdP", "recwA0I6hCYMRif4D", "recTvmtE0U8l0WjWD", "recb1bs7PfLgaZgGZ", "recarqW3RQ1AwUCuQ", "rec7mgLEdknpb7i9m", "recb2kDj9BR3bbxE3", "recsnaqrDRIBiNL1C", "recbWYklywqUSmqQX", "rectfHTWDhNWp