d9b1eddc-7895-464b-8dfd-2481e79cd99a	rec5zyLHx4VPuwy7P	Sirian Gateway Gruppen Channeling Event vom 24.07.2024 	sirian-gateway-gruppen-channeling-event-vom-24-07-2024	Hierbei handelt es sich um die Aufzeichnung des \n**Sirian Gateway Portals **vom** 24.07.2024.**\nDiese steht dir lebenslänglich zur Verfügung.\n\nSirian Gateway liefert Energien von Einkehr, Selbsterkenntnis, Realisierung und persönlichen Wachstum. Die Energien bringen alles in den Fluss, was in den Fluss gebracht werden kann und ebnen den Weg in Harmonie und erhöhen durchwegs die Frequenzen um auf das Lions Gate Portal vorzubereiten, welches dieses Jahr so potent sein wird, wie nie zu vor. \n\nFür die Volle Power dieser Tage, empfehlen wir dir das Lions Gate Gruppen Channeling mit zu nutzen. \nAuch nach dem Datum ist diese Aufzeichnung sehr Transformativ. \n\nLass dich umhüllen und begleiten von den Energien des Sirius Sternsystem.\n\n	Test Beispiel Beischreibung	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/E7hYDr4S92eXIyRrYZpleg/sQYlXz7GlIhm2tEr9Nzz4AdcIwisNdMUJNUOAkqw6gz4yPTehtUfne-wlio7iMyHz1nOa-yzI1F5QBClMeIjwr94x4Yfak2tvV8odJIOaexHk0xvednxaPUDic9Hdk7JdQN4tBPgZ7LAA3SzHLYg70I6VuiiXJWlgfWoX15c9qpROchKmHpWUEUxtbsD23bC/fBrKLvPXMH0TeKUrZC0Ikt3On8Kh0J6WGrOBOkmrpWA	\N	3900	EUR	published	\N	LCQ	\N	ozean_licht	\N	2025-11-28 14:25:55.170364+00	2025-11-28 14:25:55.170364+00	\N	{"original_fields": {"id": 1002, "created_at": "2025-05-21T08:56:42.000Z", "created_by": {"id": "usrRfU4OsN7q6fPUM", "name": "Sergej Götz", "email": "sergej@ozean-licht.com"}, "updated_at": "2025-10-05T21:08:29.000Z", "updated_by": {"id": "usrWORKFLOWEXESVC", "name": "Automations", "email": "automations@noreply.airtable.com"}, "course_link": "https://portal.ozean-licht.com/s/ozean-licht/sirian-gateway-gruppen-channeling-event-vom-24-07-2024-e0b184af", "member_count": 283, "published_at": "2024-12-16", "course_id_seq": 2, "linked_orders": ["recrjn4qi13uESa7R", "rec6dnsD2kWjSZGSj", "recTdMemNVQ5VkUdh", "reci0tPDmri7QHP2E",