87520081-a928-4a46-92de-68df1def6a18	rec6YoybrhmxjjRI2	Starseed Aktivierungs Kurs	starseed-aktivierungs-kurs	**BEST OF Aufzeichnungen, dieser Kurs findet nicht mehr Live statt. Nach dem Kauf erhältst du einen fertigen Online Kurs mit Aufzeichnungen zum sofort loslegen. **\n\n**[Zum Ersten Kurstrailer](https://youtu.be/MKB-QCdjs7A)**\n**[Klicke hier um den Zweiten Kurstrailer zu sehen](https://www.youtube.com/watch?v=iQ2TWwGQ9sE&t=23s)**\n\nDieser Kurs, liebe Starseeds, richtet sich genau an euch, an euch, die Wissen, dass es an der Zeit ist alles zu erfahren und zu Wissen um vollständig alles in euch zu aktivieren. Ich teile in diesem Kurs alles mit euch, halte nichts mehr zurück, weil ich weiß, dass ihr bereit seit für die Wahrheit und das ihr bereit seid für EUCH. \nDieser Kurs ist ein Wachrüttler, ein Transformator und Aktivator für euer komplettes Bewusstsein und eure Mission. Bitte spürt ob ihr bereit seid einen neuen Weg zu gehen, den Weg der Wahrheit, den Weg eurer Seele und den Grund weshalb ihr hier seid.\nEure Zeit ist jetzt, nicht morgen, nicht irgendwann, sondern Jetzt.\n\n\n\nLiebe Starseeds,\ndas Erste Mal seit Beginn meiner Arbeit und seit Aktivierung meiner Mission auf diesem Planeten biete ich euch diesen Kurs an.\nDieser Kurs richtet sich an alle Starseeds, die den Ruf verspüren vollständig aufzuwachen, die nicht mehr bereit sind länger zu "schlafen" oder nur halbes Wissen vorgelegt zu bekommen.\nWenn du bereit bist für die Wahrheit, für alle Antworten, nach denen du gesucht hast, auf all deine Fragen und du bereit bist, aus allen Konstruktionen aus zubbrechen, lade ich dich zu diesem Kurs ein.\nIch halte nichts mehr zurück, ich Teile jedes Detail der Wahrheit, alles, was ich nicht öffentlich auf meinen Kanälen ansprechen kann, weil einfach das Kollektiv noch nicht bereit hierfür ist. Ihr lieben Starseeds, ihr seid bereit! Ihr spürt es, ihr fühlt es und ihr wisst es und ich rufe euch auf, mit mir gemeinsam auf zu wachen, euren Weg zu gehen und frei zu sein von allem was niemals euch war.\nIhr spürt und ihr wisst tief in euch, dass da mehr Ist, das das, was ihr seht nur ein Teil der Wahrheit ist und an den Systemen auf diesem Planeten etwas absolut nicht stimmt.\n**Es ist Zeit, es ist Eure Zeit und sie beginnt jetzt! **\nIn** 6 Modulen á 1,5 Stunden **werden mein gesamtes Team und ich euch auf allen Ebenen aktivieren.\nIhr werdet transformieren und beginnen, zu leben und zu agieren als das was und wer ihr in Wahrheit seid, fern ab von der 3D Matrix und das was man euch zu erzählen versucht hat.\nDieser Kurs ist ein Aufwach- und Aktivierungs Programm für alle Aspekte von euch. Manches kann für den ein oder anderen Verstand oder das Ego unkomfortabel sein, bitte bedenke das.\nDieser Kurs übersteigt alles was bisher geteilt wurde und ist für euch gedacht, die bereit sind. Spürt ob ihr in Resonanz geht, seid ehrlich mit euch und wenn ja, heiße ich euch von ganzem Herzen willkommen.\nIch liebe euch,\n\nEure Lia\n\n	Test Beispiel Beischreibung	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/ta7ki7w2mWHUTDLPWgcLOQ/tKyDKgOcBFosp3F65LD4qP_pFY8e_TU8oNbFj6sJmSRn8goG9ihWUSUITU0fy3023OTvOxg5vEjTsiI9KWLeUnEv1GtB9Vjo6bf2cnaPen8kDCV1Ud7bN5R2NEeiq0iE0QfgkkBoG71fi29VU8SvzXhUYdtWjUrYA3Uf-U6_4zRtCWa3JG55ZNk_wQZnWbDk/nRIyGsJeWa8ZcfUz02Y7RZLDLdO1pYIOAWwRgzERDOU	\N	36900	EUR	published	\N	Basis	\N	ozean_licht	\N	2025-11-28 14:25:55.174572+00	2025-11-28 14:25:55.174572+00	\N	{"original_fields": {"id": 1031, "created_at": "2025-05-21T08:56:42.000Z", "created_by": {"id": "usrRfU4OsN7q6fPUM", "name": "Sergej Götz", "email": "sergej@ozean-licht.com"}, "updated_at": "2025-10-05T14:58:16.000Z", "updated_by": {"id": "usrWORKFLOWEXESVC", "name": "Automations", "email": "automations@noreply.airtable.com"}, "course_link": "https://portal.ozean-licht.com/s/ozean-licht/starseed-aktivierungs-kurs-00aa55ab", "member_count": 348, "published_at": "2024-12-18", "course_id_seq": 31, "linked_orders": ["recyPlQ15WZvgFXyb", "recoW5izn5gLVKfgw"