52763dbc-d609-4529-87b1-d204390703a3	recB5DBqcCk0IfVOW	Self Love	self-love	Ein Kurs in Selbstliebe\n\nWenn wir unseren Verstand ins Herz bringen und unser Herz öffnen, öffnen wir uns für den Fluss von Liebe und das Licht unseres wahren Selbst. \n\nDoch oft kommt das Erlauben sich selbst zu lieben viel zu kurz, der Verstand erzählt uns, wir müssten uns noch mehr optimieren, perfektionieren und noch mehr an uns arbeiten, um irgendwie glücklich zu sein, oder um ein von unserem Ego gesetzten Ziel zu erreichen. \n\nGeht es uns schlecht, versuchen wir wieder den Verstand ins Herz zu bringen und unser Herz zu öffnen, doch wie lange hält diesmal das wohlige Gefühl an, bis der Verstand und unsere Hypnosecodes erneut eine Illusion von Separation aufbauen? \n\nIch möchte dich in diesem Kurs an die Hand nehmen und weitere Schichten der Hypnose Codes mit dir gemeinsam lösen - für mehr Liebe für dich und alles was du bist.\n\nDu bist perfekt, wie du bist und du DARFST DU sein! \n\nLass uns deine Welt verändern und zu einem besseren Ort machen.\n\nDoch zuerst musst du lernen, dich zu lieben und deine Liebe durch dich und alles, was du bist, fließen zu lassen. \n\nLass uns eine gesunde liebevolle Beziehung mit dir selbst einleiten  … denn, das ist die Basis, jeder guten Beziehung, sie beginnt mit uns selbst!\n\nHierbei handelt es sich um den \naufgezeichneten Kurs zum sofort starten mit einer geschlossenen Telegramgruppe.\n\\*Lebenslanger Zugang\\*\n\n\n\n	Test Beispiel Beischreibung	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/iW_QNLWQcdwgHwPy5yi5Ug/8sruWWS2OlX_cCpnBZydbC-Pipjx374Grn66FX5aiKnOQgpPD7IinRP9V_FnO1seIYVlonCO1oVOp-bUkXpXXBrnkaJ6OYnCGWg0xf2rmKNPIOJmkC1X7tlWNrFHUTL_uoGi_BfcEfidoi6zGDniLLzOp_sbD4r1Ygl0-eAfk8c/UKH0xOR2r11sr8xI-lLrhGTb0GOE9bUGUfDf5h9T8fI	\N	29500	EUR	published	\N	Basis	\N	ozean_licht	\N	2025-11-28 14:25:55.187036+00	2025-11-28 14:25:55.187036+00	\N	{"original_fields": {"id": 1044, "created_at": "2025-05-21T08:56:42.000Z", "created_by": {"id":