63950c71-654e-4a40-9072-17b7c7f2bbe0	recBa133xSITKyyAd	Lia Lohmanns Interview beim Starseed Summit	lia-lohmanns-interview-beim-starseed-summit	Tauche ein in die kristalline Weisheit, die Lia in ihrem tiefgründigen Gespräch mit Konstantin Peterson beim Starseed Summit teilt.\nIn diesem faszinierenden Interview berichtet Lia offen über ihre persönlichen Kontakterfahrungen mit physischen Extraterrestrischen und enthüllt sanft kosmische Perspektiven zur wahren Natur dieser interdimensionalen Begegnungen. \nBesonders wertvoll sind Lias Einblicke zu den Starseeds und hybriden Seelen auf der Erde.\n Spüre die strahlende Energie, die durch jedes Wort fließt, während deine Seele vielleicht ihre eigene stellare Herkunft erkennt.\nLias einzigartige Frequenz dient als Brücke zwischen den Welten und bietet sowohl praktische Führung für Sternensaaten als auch höherdimensionale Aktivierungen für deine Reise als kosmisches Wesen in menschlicher Form.\nIn Liebe deine Lia \n\n\n\n	Test Beispiel Beischreibung	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/DsLimvSn8gyVU7B9twS_oA/ooYGlroLBECdm-uDzbNygjYiSJdao3NmXbMdLXW4ybkCm0739G_1XPrbscT_EgI8CT9SpbRtDBvPV0nKqOiaB4RQtCqlLTsUQedpyudqvuztHjbqSf4aWHmeFDQnOvHIgN57bEach1sa5Wuod1Tjaqq5Gey9t65ocRY0LTjMhHE/NXlb5yrB81koLP0R4KN3yzmgs6m5X6hPCFJOhX7cg28	\N	1800	EUR	published	\N	Basis	\N	ozean_licht	\N	2025-11-28 14:25:55.188467+00	2025-11-28 14:25:55.188467+00	\N	{"original_fields": {"id": 1047, "created_at": "2025-05-21T08:56:42.000Z", "created_by": {"id": "usrRfU4OsN7q6fPUM", "name": "Sergej Götz", "email": "sergej@ozean-licht.com"}, "updated_at": "2025-10-27T18:32:04.000Z", "updated_by": {"id": "usrPAGESHARE00000", "name": "Anonymous", "email": "anonymous+formpage@noreply.airtable.com"}, "course_link": "https://portal.ozean-licht.com/s/ozean-licht/Lias-Interview-aus-dem-online-Starseed-Summit-Kongress-7e3e1d21", "member_count": 21, "published_at": "2025-03-24", "course_id_seq": 47, "linked_orders": ["recripIZVcvJFTJkE", "recVokRiPPm