ae5a1afc-ddff-46fb-991f-bb442e7953fd	recCjO6Wx6MoGYVhY	Solstice Gruppen Channeling Event am 21.06.2025	solstice-gruppen-channeling-event-am-21-06-2025	Sommersonnenwende \n\\- Ein Ruf der Kristallinen Energie\n\nWenn goldenes Licht durch Kristalle tanzt,\nund Avalons Garten in Blüte steht,\nwenn heilige Stille uns sanft umfängt,\nist es Zeit, dass Magie sich neu erhebt.\n\nZwischen leuchtenden Kristallspitzen,\nim zarten Spiel des Abendlichts,\nladen wir dich ein in deine Kraft und Gleichgewicht zu finden \n\nAm 21. Juni 2025, 20:00 Uhr\nöffnet sich die diesjährige Sommer-Sonnen-Wende.\n\nIn diesem magischen Channeling-Portal\nöffnen wir unsere Herzen weit und bringen mehr von unserem kristallinen Seelenselbst zurück.\n\nLass uns gemeinsam die Kraft der Kristalle\nund die Weisheit der Sommersonnenwende nutzen dir diesjährigen Sommersonnenwende.\n\nDein Platz ist bereitet, im Zauber des Sommers und den klaren kosmischen Energien.\nMit großer Freude freuen wir uns auf dich\n\nDeine Lia \n& das gesamte Team Ozean Licht \n\n	Test Beispiel Beischreibung	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/erwc3qEIZIreuZ-87__V0w/8Gb4ZdYeO54Wett38B6lJy0ls4-JbRxWTie2L_00hYn-tU4LHXXIrJQokXbXdy9CJN69xvOMX6Y5etJFMobSuoZqFCx79JlWgzsD0jLhhKF26wGcKsfPYbJ5k71OHmksce0urn-aDbqpV1-qtb_dHjHfnLlF9XdZT-abHOCX3E8/wAmi0GN3iurXovd2EjiChWBAkzpoUBQxa-nphqC7O0k	\N	3900	EUR	published	\N	LCQ	\N	ozean_licht	\N	2025-11-28 14:25:55.190926+00	2025-11-28 14:25:55.190926+00	\N	{"original_fields": {"id": 1058, "created_at": "2025-05-21T08:56:42.000Z", "created_by": {"id": "usrRfU4OsN7q6fPUM", "name": "Sergej Götz", "email": "sergej@ozean-licht.com"}, "updated_at": "2025-10-16T10:43:16.000Z", "updated_by": {"id": "usrBbbCeepxR7ywxr", "name": "Miriam Rinderle", "email": "miriam@ozean-licht.com"}, "course_link": "https://portal.ozean-licht.com/s/ozean-licht/Solstice-Gruppen-Channeling-Event-21-06-2025-dca32702", "member_count": 662, "published_at": "2025-05-19", "course_id_seq": 58, "linked_orders"