577f4550-843d-446e-9c60-5056837e8a2e	recFyJl1axgz04j08	Projekt: Kontakt	projekt-kontakt	Projekt: Kontakt\n Essenzielle Vorbereitung für den Kontakt mit Extraterrestrischen \n\nDie Essenz\nEin transformativer Crash-Kurs, der Dir fundamentales Wissen vermittelt, wie du durch bewusstes Verhalten eine harmonische Brücke zu unseren kosmischen Geschwistern bauen kannst.\n\nKernthemen des Workshops:\n• Erkennen und Transformation unbewusster toxischer Verhaltensmuster\n• Entwicklung emotionaler und psychischer Kompatibilität mit hochschwingenden 5 Dimensionalen Wesen\n• Authentische Verhaltensweisen für respektvolle intergalaktische Begegnungen mit anderen Zivilisationen\n• Praktische Werkzeuge für friedvolle Koexistenz\n\nWarum dieser Kurs jetzt?\nWir stehen an einem kritischen Wendepunkt. Unsere kosmischen Begleiter beobachten uns im Alltag und suchen nach Menschen, die bereit sind für einen echten, harmonischen Kontakt, für die Integration in die Galaktische Community mit anderen Zivilisationen.\nDieser Kurs bereitet Dich präzise darauf vor, was wirklich wichtig ist, damit der Kontakt mit Extraterrestrischen und höher schwingenden Wesen aus den Sternen stattfinden kann.\nBereits aufgezeichnete Kurs-Einheiten:\n• Hauptkurs "Projekt Kontakt" vom April 2025\n Teil 1 (aufgezeichnet am 04.04.2025)\nTeil 2 (aufgezeichnet am 05.04.2025)\n\n**• PLUS: **\n3 wertvolle Video-Aufzeichnungen aus dem ET Kontakt Kurs vom Dezember 2023\n_Alle Aufzeichnungen stehen dir in deiner persönlichen Ablefy Kursbibliothek lebenslang zur Verfügung_\n\nIch lade jede Seele von ganzen Herzen zu diesem Kurs ein, die\n• Bereit ist für wahrhaftige Transformation\n• Verstehen möchte, wie sie durch ihr Verhalten und tägliches Handeln Brücken bauen kann\n• Teil einer bewussten, intergalaktischen Gemeinschaft sein möchte\n• Die sich authentisch auf höherdimensionale Begegnungen vorbereiten möchte\n\nDies ist kein spiritueller New Age Kurs - es ist eine präzise Vorbereitung auf reale interstellare Kommunikation. \nIch möchte mich in diesem Vorbereitungskurs auf die praktische, transformative Arbeit, die einen friedvollen und harmonischen Kontakt mit Extraterrestrischen, höher schwingenden Wesen ermöglicht, fokussieren.\n\nMit Verantwortung und Klarheit laden ich Dich zu diesem Intensiv-Kurz-Workshop ein, der dich auf eine neue Ebene des interstellaren Verständnisses hebt und die Basis für einen Kontakt mit unseren stellaren Brüdern und Schwestern darstellt.\n\nIn klarer Ausrichtung und Vorfreude auf unsere gemeinsame Entwicklung,\nDeine Lia \n\n"Echte Verbindung beginnt mit \nbewusstem Handeln" \n\n	Test Beispiel Beischreibung	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/CsFtFgGPMoiK34GN7IXBgA/041gIK60acNanB6PWkzeVboWYmALEAvCDP3e3O6_kZBB3E2vSMh3cpaIXmWghb3d33ZN0LSYLh94mEvLACp8ZRYvoBzXoIZ6Z14iEr8428hIj9f9NKAm4-5PgkovsM_ZH0Pi1mDpsdbwl1Lila5XcVpVBhfeBWzU0QJMxlJ5eTU/9ATcH88WiIi7hxo1UAfUBWoRDoeSiJ015g29dInu5is	\N	10600	EUR	published	\N	Basis	\N	ozean_licht	\N	2025-11-28 14:25:55.192283+00	2025-11-28 14:25:55.192283+00	\N	{"original_fields": {"id": 1049, "created_at": "2025-05-21T08:56:42.000Z", "created_by": {"id": "usrRfU4OsN7q6fPUM", "name": "Sergej Götz", "email": "sergej@ozean-licht.com"}, "updated_at": "2025-10-16T10:41:15.000Z", "updated_by": {"id": "usrBbbCeepxR7ywxr", "name": "Miriam Rinderle", "email": "miriam@ozean-licht.com"}, "course_link": "https://portal.ozean-licht.com/s/ozean-licht/projekt-kontakt-5836de50", "member_count": 115, "published_at": "2025-04-07", "course_id_seq": 49, "linked_orders": ["recoEvyVu9loY6L2t", "recqUZHr23KYXAuHq", "recqwmB9R9VBIikzh", "recZmvz3A8NFskX8n", "recXr5MAH6O2fYS9K", "reczRLGKbY3WB1gc8", "recsC9XUKre2JiUDE", "recSVBu3M6xOLTOfA", "recFF63bSTFg0i9hD", "recclRlv0I47pob5H", "recNaPFCxWKsea1si", "recKCASLdbplI49GE", "recVbI5X39dZ3KInu", "recPu7vZYnBGId5cJ", "recID4C9HhDneEapD", "reciWuXuiaSUhIBqA", "rec4zaWC7Kve0g9mt", "recb5Lvu7bA6RhB22", "recRsMIlxOlhSzR6s", "recQukELVHB6ihjom", "recgMAsu7rSJpMBJy", "recB0sZ5khDy