3c34365f-5e00-4905-a67f-71caeef08aa7	recGrrY1gWFilvC74	Interview - Unsterblichkeitskongress, veranstaltet von Andreas Kolos 	interview-unsterblichkeitskongress-veranstaltet-von-andreas-kolos	Hierbei handelt es sich um ein 1h Interview mit Andreas Kolos, aufgenommen, im Rahmen des "Unsterblichkeitskongresses".\n\n"Wenn die Zeit zu fließen beginnt, entfaltet sich Unsterblichkeit.\nErlebe die revolutionären Einblicke in die Illusion der Linearität.\nDer Schlüssel zur Ewigkeit liegt jenseits der Sanduhr. \nVom Inkarnations-Erfahrungsspektrum zur Auflösung der künstlichen Zeitsynchronisierung.\nBefreie dich vom Altern als bloße Idee und erschaffe eine neue Zeitwahrnehmung jenseits der linearen Begrenzung."\n\nWir wünschen dir hierbei viele, neue Perspektiven, die dich auf einem leichten, freudvollen Alltag durch dein Leben unterstützen sollen. \ndeine Lia & \ndas Ozean Licht Team\n\n\n\n	Test Beispiel Beischreibung	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/2LErcBMkPvJZQwwZ7QKi9Q/pRQhAzyxypH59mm_-DhzAJOoqqGOM3Fsh46HwBjptP1XX9LIqEC9HNV3ur2N3axBndt08LVwgSquLyDCWJ6LHNbKpQO9-gQ6D3JY7RqnDClgMz_b8lvOxdyyrIEwb1-zlXDv-sTpF6DVvj3R4XafPh5-hwVDh8Z2_VFihKUzToJMtSxLoGXbZXGAMBPgBySk/31aj9EGe05Lq06cjKK_8O0kLS12ZiQRfBMOFNyBGYLk	\N	1800	EUR	draft	\N	Interview	\N	ozean_licht	\N	2025-11-28 14:25:55.193352+00	2025-11-28 14:25:55.193352+00	\N	{"original_fields": {"id": 1057, "created_at": "2025-05-21T08:56:42.000Z", "created_by": {"id": "usrRfU4OsN7q6fPUM", "name": "Sergej Götz", "email": "sergej@ozean-licht.com"}, "updated_at": "2025-10-16T10:49:34.000Z", "updated_by": {"id": "usrBbbCeepxR7ywxr", "name": "Miriam Rinderle", "email": "miriam@ozean-licht.com"}, "course_link": "https://portal.ozean-licht.com/s/ozean-licht/Interview-Unsterblichkeitskongress-Andreas-Kolos-4d219fc3", "member_count": 25, "published_at": "2025-05-08", "course_id_seq": 57, "linked_orders": ["recboQygrSO3ZlIgK", "recL7q13s0UGf2FlG", "recgecvEn0O3NF8EF", "recN3jUcqO9zHphy6", "recWzGYh2x2vurP4d", "recBN