d758c750-175b-475c-8458-9d17dde1285f	recHOalf3lKe8B7c4	Channeling Akademie Aufzeichnungen 	channeling-akademie-aufzeichnungen	CHANNELING AKADEMIE\n\nWerde ein klarer Kanal für höherdimensionale Energien und die Quelle allen Seins.\n\nJeder ist ein Channel, aber nur wenige schaffen es ein wirkliches gutes, klares Channelmedium zu sein mit einem breiten galaktischen Team und Kristall klar übermittelten Botschaften. \nMit meiner jahrelangen Erfahrung in dem Gebiet „Advanced Channeling“ vermittle ich dir die Kunst des medialen klaren Channelns in drei aufeinander aufbauenden Modulen:\n\n•⁠ ⁠STARTER: Grundlagen & erste Verbindungen\n•⁠ ⁠AUFBAU: Vertiefung & Channeling\n•⁠ ⁠⁠MASTER: werde zu einem wahrhaftigen Channel\n\nDu lernst:\nErlebe selbst, wie Channeling\nDu lernst:\nSichere Verbindung zu höheren Dimensionen\nDownload von Wissen & Informationen\nKommunikation mit spirituellen Wesenheiten\nQualität eines klaren Channelinfs erkennen und verstehen \nverschiedene Versionen zu kanalisieren und erweiterten Psionischer Fähigkeiten \n\nBONUS: \nExklusiver Zugang zur Übungsgruppe\nHier kannst du:\n•⁠ ⁠Regelmäßig praktizieren\n•⁠ ⁠Erfahrungen austauschen\n•⁠ ⁠Erfolge teilen\n•⁠ ⁠Prozesse reflektieren\n•⁠ ⁠Dich mit Gleichgesinnten vernetzen\n\nDie Channeling Akademie vereint alle bisherigen Einzelkurse in einem umfassenden Programm.\n\nErlebe selbst, wie Channeling nicht nur dein eigenes Leben transformiert, sondern auch anderen Menschen neue Perspektiven und Freiheit schenkt.\n\nEin wichtiger Hinweis von meinem Herzen an die, den Weg des Channels gehen möchten… \n\ndiese Akademie ist nicht für kommerzielle Zwecke gedacht, sondern hilft dir auf deinem besonderen Weg zu dir selbst! \nWenn du beabsichtigst Channel zu werden aus Mangel oder kommerziellen Zwecken, ist diese Akademie nicht für dich geeignet - denn zum Channel ist man berufen … es ist Teil deines Lebens und deines Weges und niemals Mittel zum Zweck \n\nIch freue mich dich zu begleiten auf deinem Weg tiefer zu dir selbst zu kommen, \n\nIn Liebe \nDeine Lia \n\n	Test Beispiel Beischreibung	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/nGd0tRJlC26hGivD8jSDLw/0tMiy8rwBEfu85PBIJoyhbiGFAAJtRybnEifj_Bh1J6C2Rbbd226DyeIcdjimY9ZaITkkGk-4R4B_-eLumi0fmSqCPN8fGJW1-nZ2ZVaPqIy7q86_-o-4SEqklBzB65GOvn7Dlc72IKen7yLemUtDjpvz5rjqzMc4RV1kE5S_Ik/KHsaE_cxTRAcFhz2DFsd9kJT4XLYKc0PJ0QitR_JR2s	\N	1650	EUR	published	\N	Fortgeschritten	\N	ozean_licht	\N	2025-11-28 14:25:55.197314+00	2025-11-28 14:25:55.197314+00	\N	{"original_fields": {"id": 1037, "created_at": "2025-05-21T08:56:42.000Z", "created_by": {"id": "usrRfU4OsN7q6fPUM", "name": "Sergej Götz", "email": "sergej@ozean-licht.com"}, "updated_at": "2025-10-16T10:47:54.000Z", "updated_by": {"id": "usrBbbCeepxR7ywxr", "name": "Miriam Rinderle", "email": "miriam@ozean-licht.com"}, "course_link": "https://portal.ozean-licht.com/s/ozean-licht/channeling-akademie-live-aufzeichnungen-680ee0d0", "member_count": 34, "published_at": "2024-12-23", "course_id_seq": 37, "linked_orders": ["recBD7OmfP2FLv7ME", "recQwuZfXUeq54pmP", "recJaKYtZxwKL8EMV", "recsNU1QnKki6W5ui", "reckC8ModdIzNS1O2", "rec8ZrXJnB1s42JcG", "receU1UH1KK1p9tJb", "recyQfkfNH5mxuUVA", "recmoT5ZblhztBUUn", "rec5R1fqj7uoto22k", "recvRYh5qwdhZF8U8", "recDzk0RVgBf2tiKE", "recAgivyaXky0T0Ng", "reckTOOenzOn3jev2", "rec5Ik88ETuhUL8uM", "reczyLWKFXDCfm5wI", "recpeMBwozTMLnRzV", "recpqzPbsKv0Y0DEk", "rect7PZlFBTsN2Fzg", "recWWSZM2GhrT7N5t", "rec2sCEJTkejI9Rwf", "recyPCg3wOHqa9QZI", "recY81kOnbizoq443", "recxxwjGLvjqTkdnT", "recpBvUkIiBcIkMWr", "recZBh3oAE3awpljr", "recor2RThzkvFIHWw", "recoIsKjvHHzZ4VJH", "recore73ZhIrtQAri", "recFWT6jj0VoUpoJn", "recqcCDXCV7qlRxpH", "recXax5rgRDfdmL1V", "rec3gp6ag3obOcijc", "recW2SQDur1WvNnlv"], "linked_videos": ["recIRGHYO5XYHO0Mb", "recwsV7x7Uy6HSVto", "rechUGXsrQpGCyC7k", "rec7Dz7xsHXagm2tF", "recubmgTBkesx1w0D", "recWtWSeDxP8XswNy", "reca7XnuUvUKKxXev", "rec70lKdu7oaGrpam", "reczZ4ktx6Xi6wQEH", "recbkZTKIC4EeJIeQ", "rec9mn1N5qGbn8Jnr", "recG7PDfI0H5Bb