6427fe6e-64a1-4358-97d4-5ffb90641743	recHkF0hfKLbCKB3g	Sirian Gateway Gruppen Channeling Event am 28.07.2025	sirian-gateway-gruppen-channeling-event-am-28-07-2025	Light-Code-Aktivierung: Dein Quantenfeld neu kalibrieren\n\nDieses Channeling ist eine Einladung an deine Seele, das eigene System von alten, tiefsitzenden Programmen zu befreien. Stell dir dein persönliches Energiefeld wie einen Computer vor, in dem wir veraltete Datenlöcher, stagnierte Frequenzen und nicht dienliche "Programme" dekodieren und neu ausrichten. Wir schaffen ein Feld tiefer Klärung und Reinigung, um Platz für deine wahre Essenz zu schaffen.\n\nIn dieser kraftvollen Übertragung aktivieren wir gemeinsam deine innewohnende Technologie und öffnen dein Herzportal. Aus deinem Herzen entfaltet sich eine wunderschöne, weiß-goldene Licht-Sphäre, die dein gesamtes Quantenfeld umhüllt, es harmonisiert und auf höhere Schwingungsebenen kalibriert.\n\nEin zentrales Element ist die Reaktivierung deiner regenbogenfarbenen Spirale. Sie fließt von deinem Herzen durch die Wirbelsäule, verbindet dich mit den kosmischen Energien und mit Gaia, reinigt deine Chakren in der Tiefe und stellt dein gesamtes System neu ein. So kannst du universelle Weisheit im Alltag verankern und dein volles menschliches Potenzial aktivieren.\n\nWie das Funkeln von Licht auf den Wellen, so entfaltet sich dein Bewusstsein in diesem Prozess. Folge dem Ruf deiner Seele – denn sie erinnert sich an ihre ursprüngliche Kraft.\n\nVon Herzen freue ich mich auf jede Seele, die diesem Ruf folgt.\n\nDeine Lia \n	Test Beispiel Beischreibung	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/4h07gjWQMJplLPapQDjGPw/CcaoxvIx000oHnu-561K3mQfMQJOD4DQnWnLwS0-ETqkXKLLL9NMiLjsA2GxMW8asOvF5Frt2mjs4R1vLhUyDtL5yl3mGAZqFPN97KzxKvAqIAwpCbuWzLoOxVsFMtC4ClJ_OJBxYjrvoMHwWhq-vQB-ZovpLdCibVHB5kv7Dvo/L6HmhtoFRX46-TEl0yNBTGHSdgFEE6UaCqY6TY3RsD4	\N	3900	EUR	published	\N	LCQ	\N	ozean_licht	\N	2025-11-28 14:25:55.198368+00	2025-11-28 14:25:55.198368+00	\N	{"ori