1c139411-09d9-4170-9dc5-3877ad5d17e6	recJIInPQOR6UFSHI	Soul Alchemy™ - Metaphysik der Seele	soul-alchemy-metaphysik-der-seele	Soul Alchemy™ — Metaphysik der Seele\n\nDieser Kurs ist eine Ergänzung und eine Brücke für die Kurse: \nAncestry Code™ und Reality Code**™ **.\nNicht einfach nur ein Kurs, in dem Fragen beantwortet werden wie …\nWie formt sich Inkarnation,\nwas sind Inkarnationsgründe und Trigger,\nauf welche Weise inkarniert die Seele und in welcher Form inkarniert \ndie Seele?\nWas sind „Twinflames“, „Dualseelen“ und vergangene oder zukünftige Inkarnationen wirklich?\nWas ist der Unterschied zwischen echten Starseeds und normalen Starseeds und wie und warum erschafft eine Seele all diese Erfahrungen?\nWas sind Inkarnationsloops und karmische Inkarnationen und wie löse ich sie?\nSooo viele Fragen und mehr möchte ich euch in diesem Kurs beantworten, aber nicht nur das.\nOzean Licht wäre nicht Ozean Licht, wenn es nicht an das Eingemachte gehen würde.\nIn diesem Kurs aktivieren mein Team und ich ein tief transformierendes, alchemistisches Grid,\ndas euch unterstützt, toxische Strukturen zu lösen, zu heilen und zu integrieren, sodass euer Weg frei ist,\nin eine neue Version von euch selbst – aber nicht nur als der Mensch, sondern als die Seele – zu gehen. \nEin Seelen-Reinigungs-Waschgang, für alle, die keine Angst haben, ordentlich durchgerüttelt zu werden!\n\n**Ziel des Kurses:**\nDeine Klarheit, Freiheit und frische Energie zum Kreieren neuer Leben ohne Altlast.\nDu benötigst keine anderen Kurse, um diesen Kurs zu meistern, aber definitiv empfehle ich,\nein gutes Level an Eigenreflektion und Stabilität, denn mein Team, \nSt. Germain und ich werden ordentlich Gas geben. \n\nDer Kurs besteht aus 3 Modulen und einem optionalen 4. Modul:\nModul 1: Donnerstag, 20.11.2025, 20 Uhr (Berlin Zeit)\nModul 2: Freitag, 21.11.2025, 20 Uhr (Berlin Zeit)\nModul 3: Samstag, 22.11.2025, 20 Uhr (Berlin Zeit)\nOptional Modul 4: Sonntag, 23.11.2025, 20 Uhr (Berlin Zeit)\n\n\nDeine Lia \n\n	\N	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/HLeDvXMYqtgYn3UeKYGNkg/gcmkHsiW_Ufc6u2UKB3X_uvFa9hkOx7JYkAY3ESPDNybVuQtrmkJxN3JyqRXl8DSkBwmIMQjngmvuGK44_uHG_Ibg0XkGOj8mvevgRPthEz-lTQ21Lw7AK3X94IjJAeSmCMKQ0uT3PLKiGlahDjM04EgtAo1wIA33z90hH5yQGqb4lXSVkw9D8kkEIXPIycK/CZp2zntXEIUGZ3TQOodRddTzkF07UJ68LH6DJUAQYWQ	\N	28500	EUR	published	\N	Basis	\N	ozean_licht	\N	2025-11-28 14:25:55.199777+00	2025-11-28 14:25:55.199777+00	\N	{"original_fields": {"id": 1079, "created_at": "2025-09-30T18:04:45.000Z", "created_by": {"id": "usrBbbCeepxR7ywxr", "name": "Miriam Rinderle", "email": "miriam@ozean-licht.com"}, "updated_at": "2025-10-16T10:44:38.000Z", "updated_by": {"id": "usrBbbCeepxR7ywxr", "name": "Miriam Rinderle", "email": "miriam@ozean-licht.com"}, "course_link": "https://portal.ozean-licht.com/s/ozean-licht/soul-alchemy-0caf25b0", "member_count": 14, "published_at": "2025-11-20", "course_id_seq": 79, "linked_orders": ["recI7uCWLt7vDlLwK", "recx8stibrj0yld7N", "rec3B4bUV3UH4OT7b", "recWqfBHdccjoJylc", "recEOhZxri7SkOfUb", "recyFWOHUmTsoC8TD", "recBDXmOOJTHp1Msd", "recmig1Bil3d5mZkS", "rec5Y4zo1Md0WvKIB", "recoliXo8Cef3JcDT", "rec05OnQunRbiQZuT", "recFJOcywYDoZgapP", "rec1lwviWMoRvaUxI", "rec8GBR2e25au6zOY"], "thumb_created_by": ["recuRF9eSv6l8zMlT"], "ablefy_product_id": 419830}, "airtable_created_time": "2025-09-30T18:04:45.000Z"}
39aba544-b5ce-409c-9589-841513ccd7b9	recaDGNUOKI0hyBSH	Athemirah Cosmic School - Jahr 2	athemirah-cosmic-school-jahr-2	Athemirah®️ Cosmic School \n\nDie Erde und die Realität um uns herum befindet sich in tiefer Transformation und Wandel.\nWas früher Teil unserer Welt war, befindet sich im Umbruch.\nWas früher wahr war, fühlt sich heute nicht mehr stimmig an.\nSo wie sich das Bewusstsein aller Wesen auf diesem \nPlaneten ausdehnt, so lösen sich selbst die bisherigen Gesetzmäßigkeiten.\nWissenschaftler sind konfrontiert mit "unerklärlichen" Phänomenen.\n\nDer "Wall" der einst Separation bedeutet hat,\nist heute weit offen, um alles Potenzial in dir\nund allen Bewohnern der Erde zu reaktivieren.\nEinst trugen nur wenige den\nTitel des Alchemisten,\ndes Merlin und Meisters, doch heute,\nsind all diese wundervollen Meister ihrer Zeit hier,\num euch zu unterstützen,\ndie neuen Meister dieser Zeit zu werden.\nEs kommt die Zeit auf diesem Planeten, in der ein offenes Herz, Liebe, Wissen, tiefe Alchemie und Meisterschaft der Plusschlag von all denen ist, die diese Realität leben wollen.\n\nBist du bereit, der Meister, der Merlin und der Alchemist\nDIESER Zeit zu sein?\n\nBist du bereit, Realitäten zu verschieben und\nmit einem offen Herzen, in voller Kraft und Liebe\nder Meister zu sein, der du sein möchtest?\n\nLerne die "alte" Physik der "alten" Welt zu transzendieren\nund lade die Magie des Meisters ein, dir in allen Wegen zu dienen, lerne die Kräfte der Gravitation zu lösen\nund sogar die Metaphysik des neuen Lichtes für dich\nnutzbar zu machen.\nTauche mit deinen cosmischen Lehrern ab in die\ntiefe Alchemie und Metaphysik des Cosmos und lerne diese im Einklang mit deiner Seele zu nutzen.\n\nWundervolle cosmische Lehrer warten darauf, über mich mit allen Teilnehmern in DIREKTEN Kontakt zu treten und über\nGalactic Teachings jeweils zum\n2ten Samstag und 4ten Samstag des Monats\n\\- 9 Monate lang - \ndie Klassen zu führen.\n\nWir starten im Mai 2025.\nDie Telegram Community Gruppe kommt im Frühjahr.\nDen Link findest du auf deiner persönlichen Ablefy Kursseite.\n\nIn den Klassen erwarten euch kosmische und aufgestiegene Meister, Erzengel und andere Cosmische Lehrer - wie der Rat von Arcturus, Plejaden, Sirius, Lyra uvm. - um euch direkt zu unterrichten, zu begleiten, zu aktivieren und mit euch Seite an Seite, jeden Schritt auf eurem Weg in eine neue Ära zu gehen!\n\nDiese Schule ist nicht der Quantum Masterkurs - Es ist eine einzigartige Schule und arbeitet individuell mit denen, die bereit sind die alten Gesetze hinter sich zu lassen, alles zu aktivieren und die neuen Meister DIESER Zeit zu sein.\nGeführt und geleitet wird die Athemirah Schule durch mein kosmisches Team - Metathron, der Rat von Arcturus, verschiedene kosmische und aufgestiegene Meister uvm.\n\nDiese werden euch als euere Lehrer für die gesamte Zeit der Athemirah Cosmic School begleiten - während der Klassen und durch euren Alltag.\nEurer Lehrer und ich beginnen mit euch zu arbeiten von dem Moment eurer Anmeldung. Die Energien unterstützen alle Teilnehmer bis zum Ende der 9-monatigen Schule.\n\nIhr erhaltet Zugang zu einem Athemirah Meisterraum. \nErschaffen und verankert im Quantum - nur für euch.\nEr wird gehalten von den aufgestiegenen Meistern und Lehrern,\num euch den höchstmöglichen Support und einen sicheren Raum und Rückzugsort zu bieten.\nIhr habt die Möglichkeit, euch mit anderen Teilnehmern in der Athemirah Cosmic School Gruppe auszutauschen\nund zu verbinden.\nIhr erhaltet Zugang zu exklusiven Angeboten und Rabatten,\num euch das größte mögliche Wachstum zu ermöglichen.\nZudem steht mein Support-Team euch bei Fragen zu Seite.\n\nBist du bereit? \nWir freuen uns dich in der Athemirah Cosmic School \nbegrüßen zu dürfen.\n\nDa ein großer Teil der Teilnahmegebühr an das\nKids Ascension Projekt\n(Die kostenlose online Schule für Teens und Kids) geht, ist der Kurs von Rabatten ausgenommen.\nDu trägst mit deiner Teilnahme einen wunderbaren Beitrag bei, Kindern eine ganzheitliche, spirituelle Lehrmöglichkeit zur Verfügung zu stellen.\n\nIch lade dich ein diesen Kurs über den "Early-Bird" Preis zu erwerben und bereits jetzt von den Energien zu profitieren.\nDu kannst diesen Kurs in 6 oder 3 Monatsraten zahlen.\n\nDie Kurszugänge, Zoom Links und alle Neuigkeiten werden zeitnah vor Kursbeginn im Frühjahr 2025 auf deiner\npersönlichen Ablefy Kurszugangsseite \nbereitgestellt.\n\nDort findest du auch alle Zoom Aufzeichnungen jeder Kursstunde, die dir dort\njederzeit und lebenslang zur Verfügung stehen.\n\n	Test Beispiel Beischreibung	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/nvUDabSS3n2A_Xt-GtVkHA/bRiwfDVkasXtUhhVGOR_4Kz-TxEhHA7rlDweMHjvMzCJ5iFPJexbYFcwKtgHpkD3oCgvBdOWti-7Op-_MrMAXTxATabY2oJtQ4mpNhHjQzERb2Z4ozZYPyyfyLv-n6zIleFp3jCEQaCt-N9TcskOrvMhlNgt7-jKVyCWwG3QVEU/awKS4xVmgQzy5SLkYjn6zDxq8Di3VA_D3sGqTe7lGSw	\N	1777	EUR	draft	\N	Basis	\N	ozean_licht	\N	2025-11-28 14:25:55.221877+00	2025-11-28 14:25:55.221877+00	\N	{"original_fields": {"id": 1035, "created_at": "2025-05-21T08:56:42.000Z", "created_by": {"id": "usrRfU4OsN7q6fPUM", "name": "Sergej Götz", "email": "sergej@ozean-licht.com"}, "updated_at": "2025-10-28T12:27:58.000Z", "updated_by": {"id": "usrPAGESHARE00000", "name": "Anonymous", "email": "anonymous+formpage@noreply.airtable.com"}, "member_count": 439, "published_at": "2024-12-18", "course_id_seq": 35, "linked_orders": ["recerH3pSrpJW7RRn", "rec9U15h0cQHm0Exi", "recysbU5qFs9a5RGO", "recbrJgrOw2bXf6AK", "recwdyYHk3gPsXVmD", "recEe3iBdbjIjhCFf", "recrwOYWHWu4jZbeJ", "recoX23R2qRhJ9WEw", "rec2Y9lRLXSNAIKs2", "rec3ZfQJ9NJrhJPdE", "recL2tPXFldnrq5MN", "recKaN0fX9Tx8PcKd", "reclZ9m77cfpUJfUM", "recTkpY6UnZfnhDRZ", "rec7KRx0bXc4Yi8Iv", "reccVHNjer2QYt3Rj", "reclxQhoHUTv8ZsCa", "recsujMTn94HnkWwG", "recjHTAZN3uLiqral", "recxwb9gDaBvY4tiW", "recSLS9N2V83mdIGa", "recCDCYafwyZftOjk", "recmFdObKwHIZ8Pzd", "rec6UkGoMctXV2Nnp", "recFA9CUNyX20x9AV", "rectEfV5RG8F786fE", "rec2B8BlghO4n5fLF", "receCU6jeUGsQ9pTb", "