8fe85efc-884d-4737-b895-af9c9de3eced	recQvIP73jt2rzZZ9	Lia Lohmanns Interview auf dem Online Kongress "Aliens Welcome" 	lia-lohmanns-interview-auf-dem-online-kongress-aliens-welcome	In diesem Gespräch teilt Lia auf zugängliche Weise Einsichten, die unseren gewohnten Blick auf die Realität sanft erweitern. Sie schafft dabei einen Raum, in dem offen über Erfahrungen und Wahrnehmungen gesprochen wird, die über unsere alltägliche Welt hinausgehen.\n\nDas Interview von Lia, welches im Rahmen des Online Kongresses Aliens Welcome" entstanden ist, ist eine liebevolle Einladung, gemeinsam die multidimensionalen Aspekte unseres Seins zu erkunden und die Grenzen der linearen Realität mit Anmut zu transzendieren. \n\nSpüre die Resonanz der universellen Wahrheit, die in deinen Zellen erwacht, während Lia dich auf eine Reise durch die Weiten des Bewusstseins führt.\n\nIn bedingungsloser Liebe und tiefem Vertrauen in die Weisheit, die durch uns alle fließt,\ndeine Lia & \ndas Ozean Licht Team\n\n	Test Beispiel Beischreibung	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/RKpG23vSmthw0URLlO448w/_Rb-I70IsTwXnGzYMgQiSnYDoW0oi713yzG69x7FntT75hu-_hfOroSjpS5qkIP7XiC20-60UJPGpOKMRP5tIXKsQ99FrluwfPmBTTKnNrXO-_q6CGg1TVKefHMJdMRgTSnaOU16fpH7vVL3eKOtZFkB1XaSBv9XEn5Ixs2Zx6M/jLjNEa_-mn-OfHF5w_Ltik5qu0SWHQR2xS_0Tc0Lhxg	\N	1800	EUR	draft	\N	Interview	\N	ozean_licht	\N	2025-11-28 14:25:55.203047+00	2025-11-28 14:25:55.203047+00	\N	{"original_fields": {"id": 1050, "created_at": "2025-05-21T08:56:42.000Z", "created_by": {"id": "usrRfU4OsN7q6fPUM", "name": "Sergej Götz", "email": "sergej@ozean-licht.com"}, "updated_at": "2025-10-27T22:02:38.000Z", "updated_by": {"id": "usrPAGESHARE00000", "name": "Anonymous", "email": "anonymous+formpage@noreply.airtable.com"}, "course_link": "https://portal.ozean-licht.com/s/ozean-licht/lia-lohmanns-interview-aus-dem-online-kongress-Aliens-Welcome-9b28c45b", "member_count": 16, "published_at": "2025-04-08", "course_id_seq": 50, "linked_orders": ["reccGG