a6cf57be-6ef4-47ff-a4eb-c332f8fae9d0	recRQ6ICOo1LUYlOz	Planetare Aufreihung vom 25.01.2025	planetare-aufreihung-vom-25-01-2025	Planetare Aufreihung \n„Alignment“ - Kosmisches Event\nHierbei handelt es sich um die Aufzeichnung des\n Gruppen Channeling Events vom 25.01.2025 zum sofort starten.\n\\*Aufgrund von technischen Störungen begann das \nLive Event verspätet um 20:20 Uhr\\*\n\nAm 25. Januar wird eine seltene und spektakuläre Planetenkonstellation den Nachthimmel zu sehen sein. Bei diesem Ereignis werden Merkur, Venus, Mars, Jupiter, Saturn, Uranus und Neptun werden zu dieser Zeit aufgereiht sein und beginnen sich somit zu synchronisieren. \nIhre lineare Positionierung eröffnet nicht nur uns für eine atemberaubende, visuelle Darstellung, sondern bildet auch ein astrologisches Ereignis. \n\nHimmelserscheinungen wie diese unterstützen uns, zu uns selbst zu finden, neue Harmonie zu etablieren und alte Themen in der Tiefe zu lösen. \nSo entsteht ein energetisches und einzigartiges planetaren Portal im Quantum, welches wir für unsere Entwicklung nutzen können. \n\nBis du breit für einen weiteren Quantensprung in dein volles Potenzial und Erweiterung deines Herzbewusstseins? \nDann lasst uns gemeinsam die Energien der Planeten nutzen, um auf ein neues Level zu gehen.\n\nIch freue mich auf euch \nin Liebe \neure Lia\n\n	Test Beispiel Beischreibung	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/yhT3kNALQ_jigSjWgTE-bQ/G69erAIT8gHucGW6Gw0_coklDaK5B60XjUZt7rYlEV96EHdMh3ZLwy0Yio0CS1VH3rOgYRHShxwNG5YuztvnTx30mLcwKgQ1YOMmx7X25L4SSEvQe53NbjkDtKLxjakKf8-6bgcOz8J3lWi9BxkMh92Z5LyZk1cy3xffaD24xy8/bwUQ-Avm9ZIP7sk7T_OEPQLJjBJKT_FtrpeuA9r90I0	\N	3900	EUR	published	\N	LCQ	\N	ozean_licht	\N	2025-11-28 14:25:55.206552+00	2025-11-28 14:25:55.206552+00	\N	{"original_fields": {"id": 1043, "created_at": "2025-05-21T08:56:42.000Z", "created_by": {"id": "usrRfU4OsN7q6fPUM", "name": "Sergej Götz", "email": "sergej@ozean-licht.com"}, "updated_at": "2025-10-16T10:48:22.000Z", "updat