f7aa9ddb-d13b-443d-803d-c859aa7c084d	recSBOXMUeqGGI45z	Ancestry Code™	ancestry-code	Ancestry Code™\n\nGenauso wie wir unsere Zeit wählen, in der wir inkarnieren, wählen wir die Familien und Umstände, in denen wir uns erfahren.\nWir inkarnieren oft in dieselben Familien und denselben Ort, bis wir archiviert haben, was wir uns vorgenommen haben, zu archivieren.\nDie Ahnen Last, die wir tragen, und das Karma sind unsere eigene Vergangenheit, die wir uns vorgenommen haben, zu heilen und zu integrieren.\nDoch teilweise inkarnieren wir auch aus Komfort und Gewohnheit in gewohnten Strukturen, und es fällt besonders schwer, diese hinter uns zu lassen und weiterzuziehen.\nIn unserer Bewusstseinsentwicklung kommen wir früher oder später an den Punkt, an dem wir uns von den „Ketten und dem Karma“ der Vergangenheit und unseren Ahnen lösen müssen.\nDieser Kurs ist ein Ruf von mir an euch, den Sprung zu wagen und dieser und folgenden Inkarnationen eine neue Richtung zu geben und euch zu befreien von weiteren Inkarnationszyklen und karmischen Verstrickungen.\nDer Kurs besteht aus 2 intensiven LCQ‘s und einem metaphysischen Lehrteil:\nTeil 1 (Modul 1) findet am Donnerstag, 23.10.2025 um 20 Uhr (Berlin Zeit) statt,\nTeil 2 (Modul 2) am Freitag, 24.10.2025 um 20 Uhr (Berlin Zeit).\nIch freue mich auf dich,\n\n von Herz zu Herz,\n\nDeine Lia \n\n	\N	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/X0tYQuM1PF46glJ7z2i-Sw/mvCAXIXrTV9hE-Iyq-ZLms2fcXzD9jL05N0ck1rLAqu3nlOwiZxIlyTRm6QXE6bCVHlPSDjwXu4f_b_B1flpErmtdZpNxskmWQdjOVU-6CUc8e2D7l5_nbi7YB98EI7raPPmuGwSXrpuTJ0VxoSiI8ME7m2M-2cyDO419x0sAMX-hmICA6qfV_r7cwLZaGls/7woAtHEA01b5AAGl85sTK3JnqlYXsSBWJ1NTjhsMKaE	\N	12200	EUR	published	\N	Basis	\N	ozean_licht	\N	2025-11-28 14:25:55.208126+00	2025-11-28 14:25:55.208126+00	\N	{"original_fields": {"id": 1063, "created_at": "2025-09-30T18:01:14.000Z", "created_by": {"id": "usrBbbCeepxR7ywxr", "name": "Miriam Rinderle", "email": "miriam@ozean-licht.com"}, "updated_at": "2025-10-27T14:41:08