47472313-2559-4c75-8620-9fbc3ed1dc46	recSRb7sxBhOos3gu	Arcturian Light Kurs Unser Geschenk fuer Dich 	arcturian-light-kurs-unser-geschenk-fuer-dich	Ich möchte es euch allen ein Geschenk machen, ein Geschenk von meinem galaktischen Team und mir.\nDer Rat von Arcturus begleitet mich schon seit unzähligen Momenten als Teil von mir, als meine Familie, als Teil meines Bewusstseins, als Lehrer, Heiler und als Mentoren - physisch als auch telepathisch.\nIhrem Wunsch sie mehr zu Wort kommen zu lassen und direkt mir euch zu arbeiten möchte ich von Herzen gerne nachkommen.\nUnd so schenke ich euch in Co-Kreation mit dem Rat von Arcturus einen besonderen “Kontakt Kurs”\n**Hierbei handelt es sich um 4 Aufzeichnungen zum sofort starten.**\n**Diese stehen dir lebenslang in deiner persönlichen Ablefy Kursbibliothek zur Verfügung.**\n\n\n\n	Test Beispiel Beischreibung	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/cCOzNHBY8DbDdCwUKzIALQ/ClxVcMLsRTM4SDYrLPmB9tIrY9BAIsnhMTOQ2Jvy62EOu-_f_EOxtWeOEoGbbq-WA3hz4Jlf7i-CMWkEQpVsYsd3yccV8N5pH_xRsNZ2D31vNnd16fWhvcfm2w3ui9B2Tvd6b2G27DxCll-ONpcl0Hy6fAaZCxac0pa1d21wO1I/Cqqajly7vMF11fYHEqGGl8g8GN4aJhdjKFTyjX2EBfI	\N	0	EUR	published	\N	Kostenlos	\N	ozean_licht	\N	2025-11-28 14:25:55.211284+00	2025-11-28 14:25:55.211284+00	\N	{"original_fields": {"id": 1011, "created_at": "2025-05-21T08:56:42.000Z", "created_by": {"id": "usrRfU4OsN7q6fPUM", "name": "Sergej Götz", "email": "sergej@ozean-licht.com"}, "updated_at": "2025-10-05T21:27:25.000Z", "updated_by": {"id": "usrWORKFLOWEXESVC", "name": "Automations", "email": "automations@noreply.airtable.com"}, "course_link": "https://portal.ozean-licht.com/s/ozean-licht/arcturian-light-kurs-unser-geschenk-fuer-dich-d80049ec", "member_count": 5678, "published_at": "2024-12-16", "course_id_seq": 11, "linked_orders": ["recXbYRxtT4ADY3Tz", "rec0Pmx5ic4PdH4iw", "recDXRzqm8iIerCm4", "rec1cYlvxAG8znGtG", "recN8U3nuMks87bmh", "recX1ifm7l5Ez4Txv", "recdwKrQJn73lvbRD", "recaFx2J7tTLWAIyK", "recfXufuy9yXUhdd