18511068-7214-436f-9b79-eff63bb9bf91	recX1sSie5UopKUUc	Partner & Friends Special Deal 	partner-friends-special-deal	**Hallo lieber Engel,**\n\ndu möchtest ganz bestimmt deine Kurse mit deinem Partner, oder deiner Familie teilen und dir ist inzwischen sicher auch bewusst, dass jeder seinen Kurs selbst buchen muss, damit die Energien jedem im höchsten Wohle dienen können.\n\nDie Kurse bei Ozean Licht sind multidimensional und mit einer speziellen Quantenfeld Technologie codiert.\nDiese sorgt dafür, dass derjenige der den Kurs gebucht und seine Energie ausgeglichen hat, in einem speziellen Support Grid aufgenommen wird und ich, Lia mit dir im Hintergrund beginnen kann zu arbeiten und zwar NUR mit dir bzw. demjenigen, der den energetischen Ausgleich tätigt.\n\nWarum ist es wichtig, dass ich dir das sage?\n\nIn dem Moment, wenn du den Kurs bezahlt hast und den Zugang an deinen Partner, oder eine Freundin, oder wem auch immer weitergibst, gibst du deine Energie und die Energie, die ich zu dir sende, an die Person ab, und der Kurs dient auch dir nicht mehr in dem Ausmaß, wie es eigentlich gewesen wäre und du erschwerst auch der Person, mit der du geteilt hast, in ihre eigene Souveränität zu kommen und für das eigene Wohlergehen und die eigene Energie zu sorgen.\n\n**Jeder ist Souverän.**\n**Du und die Person, die Du liebst.**\n**Möchtest du nicht auch dieser Person, die Souveränität, die du in ihr siehst lassen und sie einladen, den Kurs selbst zu kaufen?**\n\n**Denn das Schöne ist, mit dieser Perspektive erlaubst du dir deine eigene Souveränität und die der Person, die du liebst und ermöglichst euch beiden das volle Spektrum an Wachstum, ohne deine / eure Energien zu verlieren, oder Energy feeding weiter zu supporten.**\n\nMöchtest du deinen Partner / Familie / Freund:in dabei haben, dann möchten wir das natürlich auch gerne ermöglichen.\n\nDafür haben wir das Partner & Friends Special kreiert.\n\nSchreib uns den Kurs und um wen es sich handelt und du erhältst einen individuellen Rabatt Gutschein für deine/n Partner/in, Freund/in, damit die Energien euch im optimalen Ausmaß und Wohlergehen dienen können.\n**Dieses gilt nicht, wenn du die Intension hast, den Kurs zu buchen und ihn an eine Person zu verschenken.**\n**Das Quantum liest diese Intension und somit ist der, der den Kurs geschenkt bekommen hat, im Support Grid aufgenommen.**\n\nIn Liebe\nDeine Lia \n& Team Ozean - Licht \n\n**Hinweis: **\n**gilt für Produkte ab 100,-**\n	Test Beispiel Beischreibung	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/i5-bJJ1a69kJhmZFGKELvg/lS17GXxHm9t1_5gJixEFgGH986TOPnJJcm8cc_CSTZ5ZQnvyBhMYOfh0b9RG1F-ouj3ApY5_yRX_Z990tVQFttMhZq8GgSdeTFsEY5xrwZhD79Uq8t3I5mR6FPBjKkqJ500RdYPjzi5GjfbwYEenreXCa8qr3XkOiuCzpCw4PY0/a2soQ8qtJHbDSZ7qWYsF7N0DReVxUA6dZYix91UnB1M	\N	0	EUR	published	\N	Kostenlos	\N	ozean_licht	\N	2025-11-28 14:25:55.21919+00	2025-11-28 14:25:55.21919+00	\N	{"original_fields": {"id": 1013, "created_at": "2025-05-21T08:56:42.000Z", "created_by": {"id": "usrRfU4OsN7q6fPUM", "name": "Sergej Götz", "email": "sergej@ozean-licht.com"}, "updated_at": "2025-10-16T10:45:54.000Z", "updated_by": {"id": "usrBbbCeepxR7ywxr", "name": "Miriam Rinderle", "email": "miriam@ozean-licht.com"}, "course_link": "https://portal.ozean-licht.com/s/ozean-licht/partner-friends-special-deal-69abf053", "member_count": 292, "published_at": "2024-12-16", "course_id_seq": 13, "linked_orders": ["recOfE7I8yfvBwGa3", "recmn3zaJ5vZUSOYI", "rechQHY07yt8rKywO", "rec0PXpaJg8LEoaNN", "recH7ZBbANfb5xcrC", "recVtmBWDO2rJS03w", "rectkBFu4BgEsyMjd", "rec2ezqCKTK9O6yp0", "recEpiR8rYnd80kM8", "rec6xZ0s81xvM0OBr", "recWOmDN34CTENib4", "reccHYqGaFapjK71K", "recm0N6UwDbmbFZPA", "rec4BZgfwjSnjVICP", "recinKmsfXhLjQrw2", "rectTmsLQSfGOeLoQ", "recdmr7nbbdDtCLxg", "recBP8EJfW2hgyYm0", "recMm81fqb8l5lnJO", "reca9Co2Y7HsKxhTE", "recQ8BhOEcRHITGlV", "recKAJKbPbu0B9Vlk", "recLgrjFrskCd4UIb", "recdwCoStZPQkCEGl", "recSuHs70CryuIy4y", "recBXySuijOXlsxEU", "rec1lzzqoRTjj1ybw", "rec2ywCcXEsh