c555a011-6f67-428a-8509-41a11115bf82	recbFJvzM46R8dUjV	Transcend Gruppen Channeling Event vom 31.12.2024	transcend-gruppen-channeling-event-vom-31-12-2024	Transcend \n\nHierbei handelt es sich um die Aufzeichnung zum sofort starten.\n\\*Die Aufzeichnung steht dir lebenslang zur Verfügung\\*\n\n\nLasst uns gemeinsam zum Beginn in das Jahr 2025 einen kraftvollen und lichtbringenden _Neuanfang_ wählen. \n\nDie Sonne spendet uns egal zu welcher Jahreszeit das notwendige Licht, Wärme und schenkt uns unsere tägliche Lebenskraft und Energie.\nDer Seestern soll uns an die Tiefe in uns erinnern und uns optimistisch zu einer Erneuerung unseres Selbstes einladen. \n\nDas Event steht _lebenslang_ in deiner Kursbibliothek zur Verfügung.\n \nDieses Transcend Event besteht aus einem **Workshop Teil **zu **aktuellen Geschehnissen **und **Veränderungen** zum "Jahreswechsel" und einem anschließenden meditativen Teil aus Light-Code-Transmission, Energiearbeit, Light Language und Toning, und ein Channeling Part mit den Energien aus dem **Lemurischen Zeitalter** und dem **Fairy Kollektiv.**\n\n	Test Beispiel Beischreibung	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/XG2Uos8J2v0ZNgxMmKxQIA/4o3850qan1ZZd3eOSjJsgwdf1bgB9C_hqT0-aar-4zaUoO5QpwR0Gx3Adm4QGVjex2WqX2crSR_ICGGtyLFG1M5t-itrGR0hL8fa05PWJ7CxCNFjpxP4-gN45reS-SCg1khNOPWrXv9Y7L1ElDFRebDC0hTRuYsZJK1yuqE1oEmq2xKvO_kKCIgIClb5dag6/CsJJEeLbrFgcrJKT-OEGbeBYcT6T7GTpNyu8B7Zue-Y	\N	3900	EUR	published	\N	LCQ	\N	ozean_licht	\N	2025-11-28 14:25:55.223232+00	2025-11-28 14:25:55.223232+00	\N	{"original_fields": {"id": 1038, "created_at": "2025-05-21T08:56:42.000Z", "created_by": {"id": "usrRfU4OsN7q6fPUM", "name": "Sergej Götz", "email": "sergej@ozean-licht.com"}, "updated_at": "2025-10-16T10:40:49.000Z", "updated_by": {"id": "usrBbbCeepxR7ywxr", "name": "Miriam Rinderle", "email": "miriam@ozean-licht.com"}, "course_link": "https://portal.ozean-licht.com/s/ozean-licht/transcend-gruppen-channeling-event-am-31-12-2023-d2680909", "member