39ecc070-0de3-4174-b07c-7bc7e1c9a120	rechB7BCA2vuSf9qE	Herzensmensch Kongress	herzensmensch-kongress	Hierbei handelt es sich um ein 1h Interview mit Jana Iger, aufgenommen, im Rahmen des "Herzensmensch Kongress".\n\nHERZENSMENSCH KONGRESS - Deine Reise zur Selbstheilung \n\nTauche ein in den Strom deiner inneren Heilkraft und entdecke die leuchtende Essenz deines wahren Seins. \nIn diesem Interview öffnen sich die Tore zu deinem natürlichen Heilungspotenzial.\nWie ein Ozean aus Licht umfängt dich das Wissen um:\n Die zarte Kraft deiner Selbstheilung\nDie Frequenzen in deinen Zellen\nDen Weg aus dem Schatten ins strahlende Licht\nDie Magie deiner Schöpferkraft\nDie Weisheit deines Herzens\n\nSpüre, wie du: \n• Deine Heilungsreise bewusst gestaltest\n• In deiner vollen Frequenz erblühst\n• Aus der Tiefe deines Herzens entscheidest\n• Dein grenzenloses Potenzial entfaltest\n\nEine Einladung, dich mit der Kunst des Heilseins zu verbinden und die Melodie deiner Seele zu leben. Lass dich berühren von zeitlosen Einsichten, die dir die Tür in ein Leben voller Gesundheit und Fülle tragen.\n\ndeine Lia & \ndas Ozean Licht Team\n\n	Test Beispiel Beischreibung	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/3tyQ-pvVWSA8MFo7LWi0wQ/c9FSji6UvxhqFAHrfmAQrdbCpGdqhTpBtTjjM46JdGV4sZ3o-Y--vR4332QGuED7NSl7V0kH34t27fk46TVpG_Oq2VMN-Jl8AclF4LkMpa1ZvZFG2EgCbl70PcL7OHMKjNnjDVxGq61vmrVRqQHT15OmbHSmoQZfIIDtLp-1xg5V-dj8hH6PoNallFQ8mRRY/55zLlBJBDHIgc5QqMVnorKAzPVI_NWYaWSyVNVLfZpI	\N	1800	EUR	draft	\N	Interview	\N	ozean_licht	\N	2025-11-28 14:25:55.229712+00	2025-11-28 14:25:55.229712+00	\N	{"original_fields": {"id": 1059, "created_at": "2025-05-21T08:56:42.000Z", "created_by": {"id": "usrRfU4OsN7q6fPUM", "name": "Sergej Götz", "email": "sergej@ozean-licht.com"}, "updated_at": "2025-10-16T10:49:40.000Z", "updated_by": {"id": "usrBbbCeepxR7ywxr", "name": "Miriam Rinderle", "email": "miriam@ozean-licht.com"}, "course_link": "https://portal.ozean-licht.com/s/ozean-licht/Herzensmensch-Kon