97896197-738b-47b5-a1fe-667cff78f8ec	recipAUbSmrWu61mn	Energy Code BASIC	energy-code-basic	Energy Code BASIC™ \nDer Schlüssel zur Meisterung deines Energiefeldes.\nTeil 1 der \nEnergy Code Trilogie\n\nTauche ein in die grundlegende Wissenschaft des Energiekörpers und erschaffe ein stabiles, klares und kraftvolles Energiefeld für dein tägliches Leben.\n\nIn diesem transformativen 4-Modul-Kurs lernst du die Grundlagen der energetischen Selbstmeisterung kennen – essentielles Wissen besonders für hochsensitive Menschen, die regelmäßig mit anderen Menschen in Kontakt und Interaktion stehen und ihre energetische Integrität bewahren möchten.\n\nWas erwartet dich? \n\nENERGY CODE BASIC ist der erste Teil einer dreiteiligen Reihe (gefolgt von Advanced und Mastery) und bietet dir eine umfassende Einführung in die Arbeit mit deinem eigenen Energiefeld. \n\nDu lernst:\n•⁠ ⁠Reine energetische Arbeit in deinem Energiefeld: Spüre, erkenne und gestalte bewusst deine energetische Signatur\n•⁠ ⁠Quantentechnologien für deinen Energiekörper: Fortschrittliche Methoden zur Stabilisierung und Stärkung\n•⁠ ⁠Energetische Ernährungsprinzipien: Wie alles, was du zu dir nimmst, dein Energiefeld beeinflusst\n•⁠ ⁠Energetische Reinigungsmethoden: Mit Räucherwerk, Klängen und Meditationstechniken\n•⁠ ⁠Gravitationskräfte meistern: Zwischen Erdung und kosmischer Anbindung\n•⁠ ⁠Chakren-Harmonisierung: Aktivierung und Ausbalancierung der Energiezentren\n•⁠ ⁠Co-Creation mit allem was ist: Dein Energiekörper als Teil des universellen Netzwerks\n\nFür welche Seelen ist dieser Kurs?\n\nVoraussetzung für diesen Kurs:\nTimeline Shift Kurs\nShadow Transform Kurs\nDiese Kurse haben wichtige Grundlagen für deine energetische Entwicklung gelegt, auf denen\n ENERGY CODE BASIC nun aufbaut.\n\nDieser Kurs ist ideal für:\n•⁠ ⁠Hochsensitive Menschen, die täglich mit anderen interagieren\n•⁠ ⁠Personen, die ihr Energiefeld schützen und stärken möchten\n•⁠ ⁠Suchende, die tiefere energetische Klarheit anstreben\n\nKursstruktur\n\n4 Module & 1 Abschluss Q&A\n\nGrundlagen des Energiefeldes & Selbstwahrnehmung\nEnergetische Ernährung & Reinigung\nChakren-Harmonisierung & Gravitationskräfte\nCo-Creation & Integration in den Alltag\n\nJedes Modul beinhaltet praktische Übungen, die dein Energiefeld stärken:\n•⁠ ⁠Spezifische Atemtechniken für energetische Klarheit\n•⁠ ⁠Körperliche Übungen (Dehnungen, Stretching, Bewegung)\n•⁠ ⁠Meditationen zur energetischen Reinigung\n•⁠ ⁠Techniken zum Lösen von energetischen Plugs und Entfernen von Astralwesen\n•⁠ ⁠Übungen zur Stabilisierung deines Energiefelds in herausfordernden Situationen\n\nENERGY CODE BASIC ist dein Einstieg in die Meisterung deines Energiefeldes. \n\nKurstermine:\n\n08.07.2025 Modul 1\n09.07.2025 Modul 2\n10.07.2025 Modul 3\n11.07.205 Modul 4\n12.07.2025 Abschluss Q&A\njeweils um 20:00 Uhr Berlin Zeit.\n\nAlle Live Sessions werden aufgezeichnet und stehen dir im Anschluss lebenslang in deiner persönlichen Ablefy Kursbibliothek zur Verfügung.\nSolltest du an einem der Live Termine nicht teilnehmen können, steht dir die Aufzeichnung zur Verfügung.\nNach den Live Terminen wird der Kurs dauerhaft in der Ozean Licht Academy zur Verfügung stehen.\n\nFolge deinem eigenen Tempo und Entwicklungspfad geführt durch deine Intuition\n\nBist du bereit, deine energetische Klarheit zu stärken und weitere Schritte zur vollständigen energetischen Souveränität zu gehen?\n\nIch freue mich auf jede einzelne Seele, die bereit ist, die Grundsteine für die energetische Arbeit zu legen.\n\nDeine Lia \n& Team Ozean Licht \n\n	Test Beispiel Beischreibung	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/tqelgd04ESWM4GR5KriMVw/M3rnFgt-27jo7TXLvPsAEPkYkiIwg_sAiUsNrEW7r_7Nysq_3yPNanqHfaji9npaXZoJOATyRgID2iXWHP_Lh21VJZ8_gir660_VC7dSGRkVthlCsHLBQDUAvkI6WbZ6eLOJBv7IiDZiBfmGpqeOJozZRQ5Bysbg6PcB4Fqjkhw/-kEvHFgyd8FFmzPKiDsB8SmPT9YQDFpk6dfXGE3k6gQ	\N	58000	EUR	published	\N	Basis	\N	ozean_licht	\N	2025-11-28 14:25:55.232389+00	2025-11-28 14:25:55.232389+00	