56629baa-40d2-4ffd-b6db-6dda8f0fc2e8	recjbodHIGDLtX7E7	Gruppen channeling Event am 21.10.2025	gruppen-channeling-event-am-21-10-2025	Live Gruppen Channeling Event \nam 21.10.2025 um 20:30 Uhr Berlin Zeit\nAn diesem Neumond- und Portaltag öffnet sich ein klarer Raum für **Unterstützung, Kalibrierung und Harmonisierung**.\nDie transformierende LCQ mit Channeling hilft dir, deine Energien zu sortieren, sanft auszurichten und neue Klarheit zu gewinnen. \nEin kraftvoller Auftakt in die Portaltrilogie, mit den weiteren, darauf aufbauenden Portalen am 11.11.2025 und am 21.12.2025.\nJedes Portal führt dich Schritt für Schritt tiefer zu dir selbst.\n**Ich freue mich auf dich** – von Herz zu Herz,\n\nDeine Lia \n\n\n	\N	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/YN7H6gD7GAytxtkFP5rd8A/tHh_FUcNhi-JtaKFeV9hH8s0x9Ado35X8tuWGPS2931hbT0vo0xxrafFo1YUUEDhSkp0TTYBmYYl4kVpJ8R3vTkLp7VCi295176_flFfSTTOnbpHI_iAx_SL6fTxyZ9GrTdMfNzP97z69XLMnJnAJQyJg0yHjxx01f5lIUJfeZ4/NKGrWW3JQpOBtAHXhCAOczcN8s6LC6YZTd_FGI09xcQ	\N	3900	EUR	published	\N	Basis	\N	ozean_licht	\N	2025-11-28 14:25:55.235008+00	2025-11-28 14:25:55.235008+00	\N	{"original_fields": {"id": 1080, "created_at": "2025-10-02T12:38:28.000Z", "created_by": {"id": "usrRfU4OsN7q6fPUM", "name": "Sergej Götz", "email": "sergej@ozean-licht.com"}, "updated_at": "2025-10-16T10:44:06.000Z", "updated_by": {"id": "usrBbbCeepxR7ywxr", "name": "Miriam Rinderle", "email": "miriam@ozean-licht.com"}, "course_link": "https://portal.ozean-licht.com/s/ozean-licht/gruppen-channeling-event-21-10-2025-050d45fc", "member_count": 48, "published_at": "2025-10-21", "course_id_seq": 80, "linked_orders": ["recccWfvipzWSSnwf", "recsjNexh3igsOkOz", "recwTkpbJNan3QWtz", "recxWB1GmznUd5UZ6", "recvIRv0gubPjya4G", "recG9cjPi3YcNMceN", "recU6NDfGUIZVENR0", "recHhQu8P7ILjbNGp", "recxBkBWVDmzgvvwW", "rec0DH43DCGjfOHau", "rec4knOsM5HMg1jLN", "recVQrJ4FQkkR6E7H", "recFbyX8VlKy8mL6v", "rec7GFQWw8TbVwp2n", "rectfeWBBBahYAg23", "recU60WYRzcffUksm", "recVYY6xfe3i