d581aa8a-53b7-4748-8897-f8663064e7d0	recklSRsI1ZKggc7S	 TimelineShift Kurs	timelineshift-kurs	Der Timeline Shift ist der Mini Masterkurs - der kleine Bruder sozusagen- zu dem 5D Quantum Masterkurs.\nDu erhältst tiefe Einblicke in die "Gesetzte" der Realität und Realitätskreierung, du lernst im Quantum zu arbeiten und wie du deinem Leben eine 180° Wendung geben kannst. In diesem Kurs erhältst du mehrere Aktivierungen, die dir Zugriff auf dein Potenzial ermöglichen, Blockaden werden gelöst, Filter gelöscht und neue Türen geöffnet.\nDu erhältst den ersten Schlüssel zu deiner Meisterschaft...den Schlüssel zu deinem Leben, welches du von nun an bewusst kreierst.\n\nTimelines - was sind das überhaupt?\nTimelines sind die Zeitlinen auf denen wir uns, auf Grund unserer Gedanken, Glaubenssätze, Emotionen und aktuellen Frequenz, befinden. Die Welt ,wie wir sie Wahrnehmen, die Dinge, die um uns herum passieren, die Gespräche und Beziehungen die wir miteinander führen.. alles, alles alles was wir wahrnehmen ist in diesem und jeden anderen Moment eine sogenannte Timeline. Und weist du was? \n\nEs gibt unzählige davon, so viele, dass es dafür keine Zahl gibt die beschreiben könnte, wie viele Timelines existieren, denn mit jeder Entscheidung die wir treffen, mit jedem Atemzug denn wir tun entstehen neue von ihnen und alte Timelines "kollabieren". \nHier liegt Segen und Wunder in einem denn - DU hast die Wahl! DU kannst deine Timeline wählen und damit alles, was um dich herum passiert!!!\n\nWie das geht und was du dafür brauchst, all das lernst du in diesem Kurs und noch ein bisschen mehr.\n\nDu erhältst über 4 Module á 1,5 -2,5 Stunden in diesem live Online Kurs alles was du Wissen musst. Jedes Modul beinhaltet diverse Aktivierungen, das lösen von Blockaden und alte Programmierungen werden umgeschrieben. Mein gesamtes Team und ich werden dich Coachen, Quantenfeld-Transformationen vornehmen, mit Hilfe von LightCodes alte Erinnerungen aus paralellen Inkarnationen zuückholen und dich somit in deine Kraft bringen.\n\nViele meiner multidimensionalen Lehrer sind während des Kurses dabei unterstützen und Supporten mit ihren Energien die Inhalte. \nDie Aufzeichnung ist durch Zeit und Raum codiert.\nDieser Kurs ist im minimum Preislevel gehalten im Vergleich\nzu dem, was er in dir bewegen wird.\n\n	Test Beispiel Beischreibung	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/CxF8fgg_XsJzaTx-5qwprw/gaN0sKm7Lcsya_NTOvLoJAx_lAeJoDzENCBMfqX1RlAOSnvURn_rmRjC81PLxStdYWcl9JpvFl3lno-IhAvefhy7RbyfHDsjsaxHgsVBkx_KruB1Lut01JdGmP05T7fbzaJ2ZeQ5F_5QIoZLM-f0NY1xNJjT2UlMdLpH3qiICXE/eW9U5rTzRi07ipJdEK18X7g3YxWlJN4ZiBvsExdhDOo	\N	26000	EUR	published	\N	Basis	\N	ozean_licht	\N	2025-11-28 14:25:55.235969+00	2025-11-28 14:25:55.235969+00	\N	{"original_fields": {"id": 1018, "created_at": "2025-05-21T08:56:42.000Z", "created_by": {"id": "usrRfU4OsN7q6fPUM", "name": "Sergej Götz", "email": "sergej@ozean-licht.com"}, "updated_at": "2025-10-05T17:37:07.000Z", "updated_by": {"id": "usrWORKFLOWEXESVC", "name": "Automations", "email": "automations@noreply.airtable.com"}, "course_link": "https://portal.ozean-licht.com/s/ozean-licht/timelineshift-kurs-22fedcc3", "member_count": 537, "published_at": "2024-12-16", "course_id_seq": 18, "linked_orders": ["recZeB3xwQpkvK77Y", "rec8xmQcxI0Ye60K8", "recdRt07n8jLJFBa5", "rectRuRqkaGE11s8J", "rec1brfPy9iUxf7iE", "recLxwKm24KQXpc2T", "recWgsjl0OB3ie050", "rechWw4z5E7qsIB6C", "recceZGglvGLIh6XA", "recTqge5AZLDG11x4", "recoygH7wmwTiQmUa", "rec6iTLaNqzd6te8H", "rec0dOiP1LrEQynqK", "rec7xrQMPH8R4OQnG", "recfNBgzrAUya8VXg", "recWKWavnMQ683kku", "recfV9jYkafDtXtzy", "recBOttOGVeVJ882n", "recsi6JE8R2bQhd7l", "recJEjXQ0EhK3lj92", "recNjgulFWmbutlBZ", "recarnnyAHPhrZBOd", "recX6yjSIqQmhJpzC", "rec8Hcb3mmdfTSqmp", "rec8tlk6DiVyggi4F", "recaFakZxATVZ4Zhi", "rechsY7b4u3xuAO7g", "recD0OQnZHCChHAbJ", "rec8whcCMQWQx34ts", "rec5VGQucZ98wdRfb", "rec3Ft6WurQ8vSlt1", "recFPiMYN9N2nZVMF", "recXHVbwJQ5j9eHrC", "recFAu4uApnbq4kgF", "recczxvwzqNTU43Ga",