9ec0c004-c4be-42f1-881b-16b837134553	recq5I5qg7yJ66cHn	Shadow Transform	shadow-transform	 „Die Dunkelheit ist deine Göttlichkeit" \n\nBei diesem Kurs handelt es sich um einen\nAufgezeichneten Kurs zum sofort starten\n\nZum Kurstrailer 1\n\nDu hast bestimmt schon oft gehört, dass du mit dem Licht die Dunkelheit transformieren musst, oder dass du die Dunkelheit bekämpfen musst, oder, dass du zu wählen hast, das eine oder das andere zu sein.\n\nDer Begriff „Licht Krieger, Lichtarbeiter oder Krieger des Lichtes“ -\nkurz du entscheidest, dass Licht zu sein und bekämpfst die Dunkelheit in dir.\nAll das sind Techniken wie du gemerkt hast, die dich mehr und mehr in Dualität bringen und den Kampf in dir verstärken, aber nicht zu Frieden und Harmonie führen.\n\nLeider, besonders zu dieser Zeit, besonders oft gelehrt und als Schlüssel in der New Age Community verkauft.\nDoch diese Lüge bringt keine Lösungen, sondern verstärkt die Dualität in dir.\n\nEs ist Zeit aufzuwachen auf einem völlig neuen Level und endlich zu erkennen, dass die Göttlichkeit alles ist, was du bist, das Licht UND deine Dunkelheit.\n\nEin Meister kennt seine eigenen Schatten, seine tiefsten Abgründe und sein Göttlichsten Ausdruck als seine Göttlichkeit und damit als seine Weisheit.\nAlle Schätze deiner Erfahrungen, alle Weisheit und alles Wissen aus all deinen Leben sind dein Schatz und deine Weisheiten, die dich befreien und zu deinem wahren Schöpfer deiner Realität machen.\n\nWahre Transformation beginnt bei dem Wechsel deiner Perspektiven. Bist du bereit die Perspektive eines Meisters und eines Schöpfers für deine Kreation einzunehmen?\n\nDann lass uns gemeinsam abtauchen in deine Göttlichkeit und dich aus dem Schatten wieder zu gebehren, in das, was du in Wahrheit bist.\nLass dich begleiten von mir, St. Germaine und anderen aufgestiegenen Meistern, um die Schätze, die in dir sind, in Wissen und Weisheit zu bringen und deine Schatten in der Göttlichkeit, die du bist, integrieren\n\nSobald du den Kurs gebucht hast, beginnen die Energien des heiligen Raums den wir erschaffen für deine Heilung und Transformation zu wirken, das bedeutet es kann sein, dass Unsicherheit, das Denken oder andere Strukturen des Egos aufzuweichen, was vollkommen normal ist. Wie alle meine Kurse ist dieser Kurs, KEIN Coaching Kurs, sondern wirkt multidimensional auf allen Ebenen in Ko Kreation mit deiner Seele und deinem höheren Selbst.\n\nBist du bereit für eine weitere Transformative Reise mit mir?\n\nIn Liebe,\nDeine Lia \n\n	Test Beispiel Beischreibung	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/J2WHeJ066XzVnQg3E7i6ew/9vnDjtIz1TXZkpqBsmSLhghURtMwVvDPTVqqFA8670fZ9rdE0Zf46j577McqcLiRr_MTIvgxVf_BY5rBuARmc7MBuYUj4A7ndLKAGIUPwDu2FjBasGtZzbI9Cxkorw_vE1JP5Vheb32bZndi-MY12wU5In34qEMLFHs9fNMWaUY/9rjEjqOnU2YgMNKLkAUyZcML6vXBcrCwDzo-R5CWQdY	\N	26000	EUR	published	\N	Aufbau	\N	ozean_licht	\N	2025-11-28 14:25:55.240822+00	2025-11-28 14:25:55.240822+00	\N	{"original_fields": {"id": 1036, "created_at": "2025-05-21T08:56:42.000Z", "created_by": {"id": "usrRfU4OsN7q6fPUM", "name": "Sergej Götz", "email": "sergej@ozean-licht.com"}, "updated_at": "2025-10-16T10:47:36.000Z", "updated_by": {"id": "usrBbbCeepxR7ywxr", "name": "Miriam Rinderle", "email": "miriam@ozean-licht.com"}, "course_link": "https://portal.ozean-licht.com/s/ozean-licht/shadow-transform-1478e420", "member_count": 539, "published_at": "2024-12-18", "course_id_seq": 36, "linked_orders": ["recQRutCYO2AeVUN1", "recd8xg5oRY15GL3Q", "recWQrT8TJC44kv2q", "recjckxPTBSv6QxKP", "recqPEe3Yn0qNXfwR", "recJQ9AQxlexWQ6bZ", "recDekn2CifpnWfU6", "recfuNG8F4AdnG7DS", "recjmFuOPpmuA3w3d", "recY3o2sPGPEp4Wmp", "recP9Tmkw0aEKhlog", "recVCvtYY8GUIvGRo", "recnsUSLxzLdPmrWR", "rec69GLOlrQn2KyU0", "rec7iyEiHuwURPtkt", "recIU9nsO9Htfy7XJ", "rec10NVwwsvpWszKX", "recRKNEPGT15mdNvk", "recagjJKpOV7oi31z", "recgyBicRehnONvbs", "recSV4Ngxktoecn3c", "reckeFisws78JoIOo", "reckO48NjrW6a9bH6", "recl4CCT8Swf4KgmT", "recZqJZpyezCNO4dQ", "recE5t4hGtXU8tEWs", "r