7c7ac864-bb54-4249-b8d3-2c66c417bc0a	recrwxR4CbaCRl7be	Q&A zu meinem Leben mit Extraterrestrischen 	qa-zu-meinem-leben-mit-extraterrestrischen	**Hierbei handelt es sich um die Aufzeichnung des Live Q&As vom 03.10.2024**\n**zum sofort starten**\n\nErfahre die Wahrheit über echten ET-Kontakt\n\n-Verschiedene Spezies\n\n-Menschen außerhalb dieser Erde\n\n-Wie handelt und denkt die Föderation wirklich?\n\n-Wie leben die ET’s außerhalb der Erde?\n\n-Wie fühlt es sich an, mit ihnen in Kontakt zu stehen?\n\nErfahre alles über\n-ihre Technologie\n\n-ihre Denkweise, ihr Handeln & fühlen\n\n-ihre Sichtweise zu Menschen - warum sie nicht kommen, um uns zu retten\n\n-über verschiedene Spezies\n\n-Warum Frequenz- und Bewusstseins Entwicklung entscheidend ist, um mit ihnen in den Kontakt zu treten\n\nLiebe Seele,\nIch freue mich, mit dir mein Wissen und meine Erfahrungen über mein Leben auf den Schiffen zu teilen.\nIch habe viel Zeit meiner Ausbildung außerhalb der Erde im Erdorbit auf dem Föderations Schiff\nVíera verbracht.\n\nIch habe von echten physischen ET’s gelernt und habe eine linear gesprochen, jahrelange Ausbildung von ihnen genossen.\n\nWir leben in einer Zeit, in der ET-Kontakt zu einem Trend geworden ist.\nIch beobachte es immer häufiger, dass Menschen beginnen, über das Thema zu sprechen.\nDas finde ich wunderschön, dass es so ist.\nDenn endlich vereinen wir uns wieder mit unserer Sternenfamilie.\nDoch, was ich leider auch oft, sehr oft beobachten darf, ist, dass viele Menschen, Geschichten erzählen und Unwahrheiten verbreiten.\n\nDamals als ich die Wahl hatte, wieder hier her zurück zu kommen auf die Erde, 🌎 musste ich die Entscheidung treffen, mit meinem Wissen, was ich von ihnen erhielt auch nach draußen, bei den Menschen, hier auf der Erde, mit meiner Mission, in die Öffentlichkeit zu treten, um den Menschen einen Pfad zu legen.\n\nDenn sie wussten:\nLia, es wird der Tag kommen, an dem die Erde deine Stimme, dein Licht ✨”benötigt”.\nDie Erde die Wahrheit, über ET’s erfahren darf, von jemanden, der selbst jahrelang mit uns gelebt hat.\n\nIch lade dich ein, in mein Spaceship, in eine Timetraveling Reise, die dein Bewusstsein sehr stark verändern wird.\nDenn ich lasse keinen Stein mehr auf dem anderen stehen, spreche über alle Themen, über die ich nicht öffentlich sprechen kann, hier in diesem geschützten Rahmen.\n\nIch bin bereit, offene Fragen von euch zu beantworten 💕\n\n\n**Die Aufzeichnung steht, dir**\n**vier Monate ab dem Kaufdatum zur Verfügung steht.**\n\nIch freue mich schon sehr auf euch und eure Fragen 🥰\n\nIn Liebe eure Lia 💕\n\n& dem gesamten Team von Ozean Licht ✨\n	Test Beispiel Beischreibung	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/Xi0fvrwpGqwdshbY5epTew/r8f8HpYEo9q89tKpcgRsV_AHTGereSdtm6e6n-mY9otLYcw9XZPYES8OGb8pBhacPswzrYi-71ispZQ6aoS_rXJ2uInPGzIl_5YfYpsvlrtyPWSNKtmHNDsglkl6iZ4AXb-t1c1BPAjJ2Aqv9XwP8dAVp6sQCUXx0W8NnjMp4Qk9DEoKdr64Fqtu8ut_YU5_NRCWgnVY4g2I5MSytAf9XA/_1vKN8Ohq_BbE1li0YWF3fdAHE8tsCYSGcFso7t2L5o	\N	4400	EUR	published	\N	Q&A	\N	ozean_licht	\N	2025-11-28 14:25:55.243434+00	2025-11-28 14:25:55.243434+00	\N	{"original_fields": {"id": 1022, "created_at": "2025-05-21T08:56:42.000Z", "created_by": {"id": "usrRfU4OsN7q6fPUM", "name": "Sergej Götz", "email": "sergej@ozean-licht.com"}, "updated_at": "2025-10-02T12:09:49.000Z", "updated_by": {"id": "usrRfU4OsN7q6fPUM", "name": "Sergej Götz", "email": "sergej@ozean-licht.com"}, "course_link": "https://portal.ozean-licht.com/s/ozean-licht/q-a-zu-meinem-leben-mit-extraterrestrischen-8dd5d49d", "member_count": 230, "published_at": "2024-12-16", "course_id_seq": 22, "linked_orders": ["recp695lQC9aAfH5w", "recdpUsh0npPr4LOS", "reclCrpdUMtU63m8d", "rectGnwcfS0tp3ztw", "rec0q3bYoEgdRb87b", "recMNaip5sQ9LtB5R", "recQwGk9yF4AIY9JA", "recBFnjDbQ9myAPfW", "reczK48JXINyiY7Ea", "recL8SDQ2mXMszoZf", "rec8r3hHRkNRXKvSd", "rec17jjoj65mkFFdE", "recOeBWwMQsjAatu8", "recWiCgsh0FrxHlGg", "recfvfLqrG1a5iHd3", "recUUQG8unctUWeiW", "recOvQyXKIRRFlxuT", "recMcde