eb9f9974-ee7b-4357-978e-22222224fcb3	recsw0hSRrPoUwPa2	 Q&A Event Aufzeichnung vom 31.07.2024	qa-event-aufzeichnung-vom-31-07-2024	**Hierbei handelt es sich um die Q&A Aufzeichnung vom 31.07.2024**\ninkl. Herz-Kohärenz-Meditation\n\n120 Minuten Quer durch Raum und Zeit zu reisen.\nEin Raum, in dem Grenzen sprengende Fragen, die euch brennend auf euren Herzen liegen, direkt an mich persönlich gestellt werden können. \nIch möchte euch die Möglichkeit geben, individuell auf die Energien der Gruppe einzugehen und euch mit dem zur Verfügung zu stehen, was ihr gerade benötigt, um euch in Euren nächsten Wachstumsschritt zu bringen. \n\nMacht es euch in euren Wohnzimmern gemütlich und genießt eine gemeinsame Zeit mit mir, dem galaktischen Team und all unseren liebevollen Community Engeln. \n\n\n\n	Test Beispiel Beischreibung	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/1CglbbFUEH59vL4tp5jsJA/v0IkCgwEs-FEKuLXN8OrN6AqvfL_WcUDdzSU5cYilSnQGwf6s3L1V8oGYPS4ceIs5cBbfeEml01OFlFa5hUcjxCejNgCQjXuYRJ9bCgDqqd4KNFOx_PioTkH4kkxQ0YLZtY-cjp68eQd0DetaVgPtlVYVFBhhUcg_MvI7rGoRoQ/hmnap8PWVjxyI1vbWN5HDqPoUI4-SeXvH3ZSbzqBxyI	\N	4400	EUR	published	\N	Q&A	\N	ozean_licht	\N	2025-11-28 14:25:55.24708+00	2025-11-28 14:25:55.24708+00	\N	{"original_fields": {"id": 1025, "created_at": "2025-05-21T08:56:42.000Z", "created_by": {"id": "usrRfU4OsN7q6fPUM", "name": "Sergej Götz", "email": "sergej@ozean-licht.com"}, "updated_at": "2025-10-02T12:21:14.000Z", "updated_by": {"id": "usrRfU4OsN7q6fPUM", "name": "Sergej Götz", "email": "sergej@ozean-licht.com"}, "course_link": "https://portal.ozean-licht.com/s/ozean-licht/q-a-event-aufzeichnung-vom-31-07-e04f8cd3", "member_count": 162, "published_at": "2024-12-16", "course_id_seq": 25, "linked_orders": ["recqLda0RTx3CadXk", "recrDXZaaGkq2Oqed", "rec9u5DVq7KOKKugc", "recK9x8nD2vVLh10A", "reczRnAmPDUTo8baB", "rectGpSftUXnQhnYl", "recS6BumTE5K1BSIA", "recCzyH6g4XuYhsUT", "recRtALx1gEbZWMzE", "recFOyEY3baEQhzrQ", "rec8rzbGEKtLWL3Xv", "rectiDRg13TB1mjNC"