bd2030f5-c625-481e-9687-5452a9f60b33	recvJiXX1Y56AgCuh	Athemirah Cosmic School - Jahr 1	athemirah-cosmic-school-jahr-1	Athemirah®️ Cosmic School\n\nLiebe Seele,\nin den Tiefen des Kosmos, dort wo die Weisheit der Zeitalter auf die neue Erde trifft, wurde ein Portal geöffnet.\nDie ersteAthemirah®️ Cosmic School - ein zeitloser Kristall der Transformation, gehütet von den Meistern der Zeiten, wartet darauf, von Dir entdeckt zu werden.\nWie ein kostbarer Schlüssel öffnet diese Schule die Tore zu den verborgenen Kammern Deiner Seele, wo alte Weisheit auf neue Meisterschaft trifft. Hier verschmelzen die Mysterien der Alchemisten mit dem Licht der neuen Zeit.\n\n**Eine Reise durch die Dimensionen:**\n•⁠ ⁠18 Module der Weisheit + 1 Bonusmodul aus dem Shadow Transform Kurs\n•⁠ ⁠Ein zeitloser Zugang zu allen Modulaufzeichnungen\n\n** Deine Lehrer und Wegbegleiter:**\n•⁠ ⁠Lia - Deine Brücke zwischen den Welten\n•⁠ ⁠St. Germain - Meister der violetten Flamme\n•⁠ ⁠Merlin - Hüter der zeitlosen Magie\n•⁠ ⁠Jeshua - Träger des Christusbewusstseins\n•⁠ ⁠Engel Metatron - Wächter der heiligen Geometrie\n•⁠ ⁠Die Hathoren - Meister der Klangwelten\n•⁠ ⁠Die Hopie - Bewahrer der Erdweisheit\n\n**Kernthemen der Schule:**\n•⁠ ⁠Aktivierung Deiner Seelensinne\n•⁠ ⁠Ausdehnung Deines Verstandes\n•⁠ ⁠Metaphysische Gesetze & Alchemie\n•⁠ ⁠Energiearbeit & Manifestation\n•⁠ ⁠Seelenmatrix-Aktivierung\n•⁠ ⁠Paradigmenwechsel-Wissen\n•⁠ ⁠Praktische Übungen für den Alltag\n•⁠ ⁠Transformierende Meditationsreisen\n•⁠ ⁠Persönliche Erfahrungen von Lia\n\n**Besondere Merkmale:**\nDurch die multidimensionale Codierung mit speziellen\nQuantenfeld Technologien ist die Schule und all ihre Energien ungebunden von linearer Zeit. Wie ein lebendiger Kristall passt sich jedes Modul Deiner individuellen Seelenfrequenz an. Die Weisheit offenbart sich Dir genau dann, wenn Deine Seele den perfekten Resonanzpunkt erreicht hat.\n\n** Diese Schule ruft Dich, wenn:**\nDu spürst, wie alte Perspektiven der Realität sich wandelt\nDein Herz sich nach tieferer Wahrheit sehnt\nDeine Seele den Ruf uralter Meisterschaft vernimmt und du den Weg zu dir und dein selbst antreten möchtest.\nDu bereit bist, ein Leuchtturm des neuen Bewusstseins zu sein\n\n**Der Kreislauf des Lichts:**\nIn der perfekten Balance des Gebens und Empfangens fließt die Hälfte Deines Beitrags in das "Kids Ascension" Projekt - ein Geschenk an die neue Generation.\n\n**Eine Einladung aus dem Herzen:**\nJede einzelne Seele, die den inneren Ruf vernimmt, ist ein kostbares Geschenk für diesen Wandel der Zeit.\nHöre in Dein Herz - es weiß, ob diese Reise jetzt für Dich bestimmt ist. Du benötigst keine speziellen Vorkenntnisse oder vorherige Kurse. Alles, was zählt, ist Dein authentischer innerer Ruf und Deine Bereitschaft zu wachsen.\nDeine Eigeninitiative und Souveränität sind die wertvollsten Geschenke, die Du mitbringst. Denn dieser Weg ist eine Einladung an Dein wahres Selbst, sich in seiner ganzen Kraft zu entfalten.\n\nIch freue mich von Herzen über jede Seele, die sich gerufen fühlt, Teil dieser transformierenden Reise zu sein.\nDie Weisheit der Meister wartet darauf, Dich zu berühren - genau dann, wenn die Zeit reif ist.\n\nIn Liebe und Verbundenheit,\nEure Lia \n\n	Test Beispiel Beischreibung	\N	\N	1111	EUR	published	\N	Basis	\N	ozean_licht	\N	2025-11-28 14:25:55.251056+00	2025-11-28 14:25:55.251056+00	\N	{"original_fields": {"id": 1039, "created_at": "2025-05-21T08:56:42.000Z", "created_by": {"id": "usrRfU4OsN7q6fPUM", "name": "Sergej Götz", "email": "sergej@ozean-licht.com"}, "updated_at": "2025-10-16T10:42:15.000Z", "updated_by": {"id": "usrBbbCeepxR7ywxr", "name": "Miriam Rinderle", "email": "miriam@ozean-licht.com"}, "course_link": "https://portal.ozean-licht.com/s/ozean-licht/athemirah-cosmic-school-schuljahr-1-14439dc8", "member_count": 133, "published_at": "2024-12-23", "course_id_seq": 39, "linked_orders": ["recugukAGjsHoIrB4", "recozR8I0f1A8rojV", "recY4FikFzuBowNW1", "recj7VuIDvceJdBVZ", "recf3d1aUOhCe2XoR", 