f596b00c-f4b1-4d05-bb21-986658fea784	recxEJZnJIgB9tAv1	Workshop mit Q&A Teil: aktuelle UFO Sichtungen, UAP Enthuellungen und Ereignisse zum Jahresende 2024	workshop-mit-qa-teil-aktuelle-ufo-sichtungen-uap-enthuellungen-und-ereignisse-zum-jahresende-2024	Hierbei handelt es sich um die Aufzeichnung des \nWorkshops vom 28.12.2024, zum sofort starten.\n\nWir möchten euch zum Jahresende alle Zusammenhänge mit verschiedenen Versionen der Erde in Anbetracht der aktuell laufenden UFO und UAP Enthüllungen durch die Medien und auf den Social Media Kanälen klarstellen.\nWir möchten euch alles teilen, was ich aus meinen Kontakten mit Extraterrestrischen, meinem Wissen und Aufenthalten im Orbit - aus der Sicht der Extraterrestrischen Spezies, die sich hier im Erdorbit platziert haben, um die Menschen zu unterstützen, mitgenommen habe. \n\nDa es sich um pikante Informationen handelt, kann ich diese aktuell nicht öffentlich auf YouTube teilen und möchte daher folgende Themen in diesem Workshop teilen:\n\n•⁠ ⁠Die Galaktische Föderation beleuchtet im Rahmen der aktuellen Erdgeschehnisse und des „Disclosure“ Prozesses\n•⁠ ⁠Was steckt hinter den aktuellen News einer möglich geplanten „Alien Invasion“?\n•⁠ ⁠Wie hängen die US-Wahlen mit angeblichen Weltkriegsnachrichten zusammen, Welche Agenda steckt hinter den Medien und von welchen Kräften wird diese erschaffen? \n•⁠ ⁠Was sind die in den Medien gezeigten UFO Sichtungen wirklich?\n•⁠ ⁠Die Kollektive Manifestation des „Deep States“ in 3D, im Ursprung beleuchtet, auf Basis der Seelenkonzepte\n\nUns liegt es am Herzen, dass wir in diesem Mini-Workshop über alles aufklären, was im Rahmen der aktuellen Ereignisse der UFO/UAP Enthüllungen wirklich geschieht - und dir somit die Angst vor negativer Manipulation der dahinterliegende Agenden nehmen kann und du in deiner Klarheit und Souveränität durch diese Realitäten gehen kannst.\n\nNach einem Informationsteil, möchten wir noch einen anschließenden Q&A Teil öffnen, in dem du die Möglichkeit hast, bis dahin noch ungeklärte Fragen vollständig beantwortet zu erhalten, sodass nach diesem Workshop keine Fragen im Rahmen der aktuellen Disclosure Thematik offen bleiben.\nIn Liebe \nDeine Lia \n\n	Test Beispiel Beischreibung	https://v5.airtableusercontent.com/v3/u/47/47/1764352800000/RD8RqmeOmTrgF-i7GYFZGQ/l0krHv0cO1VfZM2dGYd9s_x7sgiKFqFPsRtsqvhwHSNqY8kOBrZsNA0I31YfOHwq9R6TQqf7jAk0AkVlXNAafxaq0YAz6-nAcU1XUdIWUx9tl1raAXwUl2cSd6kMrPF4URdO_82MpnuAVd-aIhIxou2kpgB1PnXntEBwyE52DDI/i9xUi7NGzwYOkdh-tEPUarxbvweP_IjweCsr16jwaMs	\N	1800	EUR	published	\N	Q&A	\N	ozean_licht	\N	2025-11-28 14:25:55.253886+00	2025-11-28 14:25:55.253886+00	\N	{"original_fields": {"id": 1040, "created_at": "2025-05-21T08:56:42.000Z", "created_by": {"id": "usrRfU4OsN7q6fPUM", "name": "Sergej Götz", "email": "sergej@ozean-licht.com"}, "updated_at": "2025-10-16T10:48:08.000Z", "updated_by": {"id": "usrBbbCeepxR7ywxr", "name": "Miriam Rinderle", "email": "miriam@ozean-licht.com"}, "course_link": "https://portal.ozean-licht.com/s/ozean-licht/workshop-mit-q-a-teil-aktuelle-ufo-sichtungen-uap-enthuellungen-und-ereignisse-zum-jahresende-2024-0bc0fde3", "member_count": 714, "published_at": "2024-12-23", "course_id_seq": 40, "linked_orders": ["recsg3WirsqRQ1r8s", "rec5ALYSJN9DhldFT", "reccfVpfvymAytaHv", "recqVPCFUq4GxGjKu", "recxGiRh0C2Cnz1v3", "recDGNW6eGJCOZJvT", "recXgDC9AJOChaeL9", "recujjGRoHwSlEUGt", "recGTSVD6OzhMgUyC", "recqhCwhLZG0Er7wr", "recuZBos9eoYlyxTC", "recEfXlQyS0NhOc4Z", "recx45nLwbjaM97e2", "recsDMZzUTJdCOX1p", "recspJr7eLgju7lFS", "recfhUWcblXnej8Mc", "recJuMa8BoXFOXnVX", "recKukAcQxMKpWo1Y", "recoPKk8JOZql22OY", "recVGxr2hxLqnO03L", "rec4L65KzTtIyuCO3", "rec4nEZDvUCk0zvMw", "rec6WkZWdFAOjxG1W", "recJ4Sgehzf89Xe2d", "recNscyA5tzWuRDbN", "recGxKg2YBFqGPi30", "rectjpGEqtXSjOk2J", "recK5gWeBmwqnovvd", "recQ4BMgWkYlkIm7J", "recmCl0wvLQ8mrdve", "recLWwbVGfc4YHG2A", "recwkUd8dYnOqcNIk", "recmftGlN027najQH", "recO8AvyCCsSVeByq", "recGIPPD20A12b6gd", "recITZiR6aieawUCd", "recBn9UXE09YO1alE", "