23ff4a6a-67bb-4667-86b2-c906ad65e2b2	recxRFZXjqK4ZIpB1	Sterben für “Anfänger“	sterben-fuer-anfaenger	“Das Ende ist der Anfang”\n\nHierbei handelt es sich um die Aufzeichnung des Workshops vom 29.12.2024.\nNach dem Kauf kannst du direkt mit dem Workshop starten.\n\nDieser teilt sich in einen 1,5h Kursteil\n& in eine 30 Min, Meditation\n"Sterbeprozess erlauben & loslassen", auf.\n\nDoch von was?\n\nWas ist mit dem “Tod” gemeint?\n\nStirbt nur der Mensch?\nKann die Seele sterben?\n\nWas geschieht nach dem Tod?\nWo geht die Seele hin?\n\nKommen wir in den Himmel, oder die Hölle\n\\- gibt es so etwas überhaupt?\nWer kommt in das Licht und wer nicht?\nKönnen wir entscheiden und beeinflussen, ob wir in das Licht gehen?\n\nIn welchen Dimensionen landen wir, welche existieren?\n\nInkarnationsloop, was ist das und wie steige ich aus?\n\nKönnen wir mehrere “Tode” in einem menschlichen Leben erfahren?\nWie geht das und warum?\n\nHaben wir jederzeit die Möglichkeit zu “sterben” und uns somit ein neues Leben zu erschaffen, ohne dass wir uns davor fürchten müssen?\n\nWieso haben wir Angst vor dem Sterben?\nKönnte diese Angst ein Ausdruck der Ungewissheit in uns sein?\nDass wir uns nicht bewusst sind, was genau das “Sterben” eigentlich meint und was danach mit uns geschieht?\n\nDenn wusstest du, dass das “Sterben” etwas schönes ist?\nEs ist Deine Freiheit\n\nLasst uns endlich Schluss machen mit allen Angst und Hypnosecodes rund um das Thema Tod und in diesem Workshop in eine tiefes Decoding gehen.\nDenn die Wahrheit übers sterben blieb uns bisher verborgen.\nLass uns gemeinsam diese Ängste lösen und die Schönheit des Sterbens erlauben.\n\nIn diesem Workshop Sterben für "Anfänger” 👻🪦\nerfährst du all die\nMythen und Illusionen im Zusammenhang\nmit dem Tod und dem Sterben, die dich von einem wahrhaftigen, friedvollen Sterben in Anmut und Stolz abhalten.\n\nAlle Fragen und Antworten im Workshop.\n\nIch lade euch von Herzen ein \n\nIn Liebe\nEure Lia und\ndas gesamte Team Ozean Licht \